INSERT INTO `Meaning` VALUES (0,0,'adjective','markedly different from an accepted norm.','When the financial director started screaming and throwing food at his co-workers, the police had to come in to deal with his aberrant behavior.','Magoosh\r'),(1,0,'noun','a deviation from what is normal or expected.','Aberrations in climate have become the norm: rarely a week goes by without some meteorological phenomenon making headlines.','Magoosh\r'),(2,0,'adjective','difficult to understand; incomprehensible.','Physics textbooks can seem so abstruse to the uninitiated that readers feel as though they are looking at hieroglyphics.','Magoosh\r'),(3,0,'adjective','refusing to change one\'s mind.','Civil rights icon Rosa Parks will forever be remembered for adamantly refusing to give up her seat on a public bus--even after the bus driver insisted, she remained rooted in place.','Magoosh\r'),(4,0,'verb','to warn strongly, even to the point of reprimanding.','Before the concert began, security personel admonished the crowd not to come up on stage during the performance.','Magoosh\r'),(5,0,'adjective','serving to warn; expressing reproof or reproach especially as a corrective.','At the assembly, the high school vice-principal gave the students an admonitory speech, warning them of the many risks and dangers of prom night.','Magoosh\r'),(6,0,'noun','one who professes great sensitivity to the beauty of art and nature.','A true aesthete, Marty would spend hours at the Guggenheim Museum, staring at the same Picasso.','Magoosh\r'),(7,0,'adjective','concerned with the appreciation of beauty.','The director, not known for his aesthetic sensibilities, decided not to use costumes at all, and put on the play in everyday clothing.','Magoosh\r'),(7,0,'noun','a set of principles underlying and guiding the work of a particular artist or artistic movement.','The artist operated according to a peculiar aesthetic, not considering any photograph to be worth publishing unless it contained a marine mammal.','Magoosh\r'),(8,0,'noun','a mixture of multiple things.','The band\'s music was an amalgam of hip-hop, flamenco and jazz, blending the three styles with surprising results.','Magoosh\r'),(9,0,'adjective','open to more than one interpretation.','The coach told his team, \"Move towards that side of the field\"; because he did not point, his directions were ambiguous, and the team had no idea to which side he was referring.','Magoosh\r'),(10,0,'adjective','mixed or conflicting emotions about something.','Sam was ambivalent about studying for the exam because doing so ate up a lot of his time, yet he was able to improve his analytical skills.','Magoosh\r'),(11,0,'verb','make something bad better.','Three Cups of Tea tells the story of western man who hopes to ameliorate poverty and the lack of education in Afghanistan.','Magoosh\r'),(12,0,'adjective','easily persuaded.','Even though she did not like the outdoors, Shirley was generally amenable and so her brother was able to persuade her to go camping.','Magoosh\r'),(13,0,'adjective','shapeless.','His study plan for the GRE was at best amorphous; he would do questions from random pages in any one of seven test prep books.','Magoosh\r'),(14,0,'adjective','not normal.','According to those who do not believe in climate change, the extreme weather over the last five years is simply anomalous--average temps should return to average, they believe.','Magoosh\r'),(15,0,'noun','something that is not normal, standard, or expected.','After finding an anomaly in the data, she knew that she would have to conduct her experiment again.','Magoosh\r'),(16,0,'noun','an intense feeling of dislike or aversion.','Maria had an antipathy for tour groups, often bolting to the other side of the museum as soon as she saw a chaperone leading a group of wide-eyed tourists.','Magoosh\r'),(17,0,'adjective','sharply contrasted in character or purpose.','His deep emotional involvement with these ideas is, in fact, antithetical to the disattachment Buddhism preaches.','Magoosh\r'),(18,0,'adjective','marked by a lack of interest.','Mr. Thompson was so talented at teaching math that even normally apathetic students took interest.','Magoosh\r'),(19,0,'noun','an absence of emotion or enthusiasm.','Widespread apathy among voters led to a very small turnout on election day.','Magoosh\r'),(20,0,'adjective','being of questionable authenticity.','The web is notorious for sandwiching apocryphal stories between actual news.','Magoosh\r'),(21,0,'verb','pacify by acceding to the demands of.','Neville Chamberlain, the British prime minister during WWII, tried to appease Hitler and in doing so sent a clear message: you can walk all over us.','Magoosh\r'),(22,0,'adjective','based on a random, groundless decision.','One of the arbitrary decrees in place during the emperor\'s rule is that all citizens pay him weekly homage at his palace. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(23,0,'adjective','requiring secret or mysterious knowledge.','Most college fraternities are known for arcane rituals that those hoping to the join the fraterntiy must learn.','Magoosh\r'),(24,0,'adjective','exhibiting artistic skill.','Picasso is generally considered the most artful member of the Cubist movement.','Magoosh\r'),(24,0,'adjective','clever in a cunning way.','Bernie Madoff\'s artful Ponzi scheme stole billions of dollars from investors and is considered the largest financial fraud in U.S. history.','Magoosh\r'),(25,0,'adjective','practicing self-denial.','His ascetic life is the main reason he inspired so many followers, especially since he gave up wealth and power to live in poverty.','Magoosh\r'),(25,0,'noun','one who practices great self-denial.','Historically, ascetics like Ghandi are often considered wise men partially because of their restraint.','Magoosh\r'),(26,0,'adverb','with a look of suspicion or disapproval.','The old couple looked askance on the teenagers seated next to them, whispering to each other, \"They\'ve got rings through their noses and purple hair!\".','Magoosh\r'),(27,0,'adjective','willing to be bold in social situations or to take risks.','As all of the other campers cowered in their tents, Bill, armed only with a flashlight, audaciously tracked down the bear that had raided their food.','Magoosh\r'),(28,0,'noun','aggressive boldness in social situations.','She surprised her colleagues by having the audacity to publically criticize the findings of an distinguished scientist.','Magoosh\r'),(29,0,'adjective','favorable, the opposite of sinister.','Despite an auspicious beginning, Mike\'s road trip became a series of mishaps, and he was soon stranded and penniless, leaning against his wrecked automobile.','Magoosh\r'),(30,0,'adjective','practicing self-denial.','His lifestyle of revelry and luxurious excess could hardly be called austere.','Magoosh\r'),(30,0,'adjective','unadorned in style or appearance.','Late Soviet architecture, although remaining largely austere, moved into experimental territory that employed previously unused shapes and structures.','Magoosh\r'),(30,0,'adjective','harsh in manner of temperament.','The principal of my elementary school was a cold, austere woman; I could never understand why she chose to work with children.','Magoosh\r'),(31,0,'adjective','excessively greedy.','Since avaricious desire is similar to gluttony or lust--sins of excess--it was listed as one of the seven deadly sins by the Catholic church.','Magoosh\r'),(32,0,'adjective','repeated too often; overfamiliar through overuse.','The professor used such banal expression that many students in the class either fell asleep from bordeom or stayed awake to complete his sentences and humor friends.','Magoosh\r'),(33,0,'noun','a trite or obvious remark.','Herbert regarded the minister\'s remark as a mere banality until Sharon pointed out profound implications to the seemingly obvious words.','Magoosh\r'),(34,0,'verb','to give a false representation to; misrepresent.','The smile on her face belies the pain she must feel after the death of her husband.','Magoosh\r'),(35,0,'adjective','characteristic of one eager to fight.','Tom said that he was arguing the matter purely for philosophical reasons, but his belligerent tone indicated an underlying anger about the issue.','Magoosh\r'),(36,0,'verb','to reveal or make known something, usually unintentionally.','With the gold medal at stake, the gymnast awaited his turn, his quivering lip betraying his intense emotions.','Magoosh\r'),(37,0,'verb','support and strengthen.','The case for the suspect\'s innocence was bolstered considerably by the fact that neither fingerprints nor DNA were found at the scene. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(38,0,'adjective','unrestrained by convention or propriety.','Their large \"donations\" to the local police department gave the drug cartel the brazen confidence to do their business out in the open.','Magoosh\r'),(39,0,'adjective','relating to the pleasant aspects of the country.','The noble families of England once owned vast expanses of beautiful, bucolic land.','Magoosh\r'),(40,0,'verb','grow and flourish.','China\'s housing market is burgeoning, but some predict that the growth is merely a bubble and will burst much like the U.S. real estate bubble of 2008.','Magoosh\r'),(41,0,'noun','making of a false statement meant to injure a person\"s reputation.','With the presidential primaries well under way, the air is thick with calumny, and the mud already waist- high.','Magoosh\r'),(42,0,'verb','to reprimand harshly.','Drill sergeants are known to castigate new recruits so mercilessly that the latter often break down during their first week in training.','Magoosh\r'),(43,0,'verb','to express strong disapproval.','After being caught in bed with a mistress, the mayor was quickly censured by the city council.','Magoosh\r'),(44,0,'verb','to reprimand harshly.','Though chastised for his wanton abuse of the pantry, Lawrence shrugged off his mother\'s harsh words, and continued to plow through jars of cookies and boxes of donuts.','Magoosh\r'),(45,0,'verb','to chuckle, laugh merrily.','Walking past the bar, I could hear happy, chortling people and the blast of horns from a jazz band.','Magoosh\r'),(46,0,'verb','restrict or confine.','Their tour of South America was circumscribed so that they saw only popular destinations and avoided the dangerous parts of cities. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(47,0,'verb','cleverly find a way out of one\'s duties or obligations.','One way of circumventing the GRE is to apply to a grad school that does not require GRE scores.','Magoosh\r'),(48,0,'verb','acknowledge defeat I concede.','You win!.','Magoosh\r'),(48,0,'verb','admit (to a wrongdoing).','After a long, stern lecture from her father, Olivia conceded to having broken the window.','Magoosh\r'),(48,0,'verb','give over; surrender or relinquish to the physical control of another.','The Spanish were forced to concede much of the territory they had previously conquered.','Magoosh\r'),(49,0,'verb','be confusing or perplexing to.','Though Harry loved numbers, he found calculus confounding.','Magoosh\r'),(49,0,'verb','mistake one thing for another.','Americans often confound sweet potatoes with yams, and refer to both vegetables by the same name.','Magoosh\r'),(50,0,'adjective','without any attempt at concealment; completely obvious.','American basketball players are always conspicuous when they go abroad--not only are they American, but some are over seven feet tall.','Magoosh\r'),(51,0,'noun','an abstract part of something.','The constituents of the metal alloy are nickle, copper, and tin.','Magoosh\r'),(52,0,'verb','interpreted in a particular way.','The author\'s inability to take a side on the issue was construed by both his opponents and supporters as a sign of weakness.','Magoosh\r'),(53,0,'noun','a gathering of persons representative of some larger group.','A small contingent of those loyal to the king have gathered around the castle to defend it.','Magoosh\r'),(53,0,'adjective','possible but not certain to occur.','Whether the former world champions can win again this year is contingent upon none of its star players getting injured.','Magoosh\r'),(54,0,'noun','the feeling of remorse or guilt that comes from doing something bad.','Those who show contrition during their prison terms--especially when under review by a parole board-- often get shortened sentences.','Magoosh\r'),(55,0,'verb','to pull off a plan or scheme, usually through skill or trickery.','Despite a low GPA, he contrived to get into college, going so far as to write his own glowing letters of recommendation. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(56,0,'adjective','in abundant supply.','In midsummer, there are copious popiscle stands at the beach; in the winter, there are none.','Magoosh\r'),(57,0,'adjective','pathetically cowardly.','Though the man could have at least alerted the police, he crouched cravenly in the corner as the old woman was mugged.','Magoosh\r'),(58,0,'adjective','mysterious or vague, usually intentionally.','Since Sarah did not want her husband to guess the Christmas present she had bought him, she only answered cryptically when he would ask her questions about it.','Magoosh\r'),(59,0,'verb','reach the highest or most decisive point.','Beethoven\'s musical genius culminated in the 9th Symphony, which many consider his greatest work.','Magoosh\r'),(60,0,'noun','a state of guilt.','Since John had left his banana peel at the top of the stairwell, he accepted culpability for Martha\'s broken leg.','Magoosh\r'),(61,0,'adjective','characterized by good taste in manners and conduct.','Sally\'s parties are decorous affairs, and instead of the usual beer and music, there is tea and intellectual conversation.','Magoosh\r'),(62,0,'noun','propriety in manners and conduct.','You will obey the rules of decorum for this courtroom or spend the night in a jail cell, said the judge to the prosecutor.','Magoosh\r'),(63,0,'adjective','showing respect.','If you ever have the chance to meet the president, stand up straight and be deferential.','Magoosh\r'),(64,0,'adjective','harmful to living things.','The BP oil spill in the Gulf of Mexico was deleterious to the fishing industry in the southern states.','Magoosh\r'),(65,0,'verb','describe in detail.','After a brief summary of proper swimming technique, the coach delineated the specifics of each stroke, spending 30 minutes alone on the backstroke.','Magoosh\r'),(66,0,'verb','to object or show reluctance.','Wallace disliked the cold, so he demurred when his friends suggested they going skiing in the Alps.','Magoosh\r'),(67,0,'verb','charge falsely or with malicious intent; attack the good name and reputation of someone.','Count Rumford denigrated the new theory of heat, demonstrating that it was wholly inadequate to explain the observations.','Magoosh\r'),(68,0,'verb','be a sign or indication of; have as a meaning.','Even if the text is not visible, the red octagon denotes \"stop\" to all motorists in America.','Magoosh\r'),(69,0,'adjective','(or a creative product, e.','g. music, writing, etc.) not original but drawing on the work of another person. Because the movies were utterly derivative of other popular movies, they did well at the box office. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(70,0,'verb','come from; be connected by a relationship of blood, for example.','Many words in the English language are derived from Latin, including the word \"derive.\".','Magoosh\r'),(70,0,'verb','reason by deduction; establish by deduction.','From the multiple set of footprints in the living room, the investigator derived an important clue: Sheila was not alone in the room at the time of the murder.','Magoosh\r'),(71,0,'adjective','instructive (especially excessively).','Tolstoy\'s The Death of Ivan Illyich is a didactic novel, instructing the reader on how to live a good life.','Magoosh\r'),(72,0,'adjective','showing modest reserve; lacking self-confidence.','As a young girl she was diffident and reserved, but now as an adult, she is confident and assertive.','Magoosh\r'),(73,0,'adjective','wasting time.','Lawyers use dilatory tactics so that it takes years before the case is actually decided.','Magoosh\r'),(74,0,'noun','an amateur who engages in an activity without serious intentions and who pretends to have knowledge.','Fred has no formal medical training; while he likes to claim authority on medical issues, he is little more than a dilettante.','Magoosh\r'),(75,0,'adjective','discontented as toward authority.','After watching his superior take rations from the soliders, he quickly became disaffected and rebeled.','Magoosh\r'),(76,0,'adjective','constituting a separate entity or part.','What was once known as Czechoslovakia has since split into two discrete, independent nations.','Magoosh\r'),(77,0,'adjective','unbiased; neutral.','The potential juror knew the defendant, and therefore could not serve on the jury, which must consist only of disinterested members.','Magoosh\r'),(78,0,'adjective','unaffected by strong emotion or prejudice.','A good scientist should be dispassionate, focusing purely on what the evidence says, without personal attachment.','Magoosh\r'),(79,0,'verb','cause to become widely known.','Before the effects of anaethesia were disseminated, patients had to experience the full pain of a surgery.','Magoosh\r'),(80,0,'adjective','highly opinionated, not accepting that your belief may not be correct.','Bryan is dogmatic in his belief that the earth is flat, claiming that all pictures of a spherical earth are computer generated.','Magoosh\r'),(81,0,'noun','compulsory force or threat.','The witness said he signed the contract under duress and argued that the court should cancel the agreement.','Magoosh\r'),(82,0,'adjective','comprised of a variety of styles.','Joey was known for his eclectic tastes in music, one moment dancing to disco the next \"air conducting\" along to Beethoven\'s 9th symphony.','Magoosh\r'),(83,0,'adjective','avoiding waste, efficient.','Journalists favor an economical style of writing, in which no unnecessary words are used and every sentence is as short as possible.','Magoosh\r'),(84,0,'adjective','enlightening or uplifting so as to encourage intellectual or moral improvement.','I recently read an article in the Times about whether good literature is edifying or not; specifically, does reading more make a person more moral.','Magoosh\r'),(85,0,'adjective','producing the intended result.','Since Maggie\'s cough syrup, which had expired five years back, was no longer efficacious, she coughed through the night.','Magoosh\r'),(86,0,'adjective','standing out in negative way; shockingly bad.','The dictator\'s abuse of human rights was so egregious that many world leaders asked that he be tried in an international court for genocide.','Magoosh\r'),(87,0,'verb','call forth (emotions, feelings, and responses).','Just smiling--even if you are depressed--can elicit feelings of pleasure and happiness.','Magoosh\r'),(88,0,'verb','make clearer and easier to understand.','Youtube is great place to learn just about anything--an expert elucidates finer points so that even a complete novice can learn.','Magoosh\r'),(89,0,'adjective','standing above others in quality or position.','Shakespeare is an eminent author in the English language, but I find his writing uninteresting and melodramatic.','Magoosh\r'),(90,0,'verb','to sap energy from.','John preferred to avoid equatorial countries; the intense sun would always leave him enervated after he\'d spent the day sightseeing.','Magoosh\r'),(91,0,'verb','give rise to.','The restrictions of the Treaty of Versailles were so severe that they engendered deep hatred and resentment in the German people.','Magoosh\r'),(92,0,'adjective','fixed firmly or securely.','By the time we reach 60-years old, most of our habits are so entrenched that it is difficult for us to change.','Magoosh\r'),(93,0,'adjective','lasting a very short time.','The lifespan of a mayfly is ephemeral, lasting from a few hours to a couple of days.','Magoosh\r'),(94,0,'adjective','confusing or ambiguous.','The findings of the study were equivocal--the two researchers had different opinions on what the results signified.','Magoosh\r'),(95,0,'verb','to completely destroy.','I tried eradicating the mosquitos in my apartment with a rolled up newspaper, but there were too many. of them.','Magoosh\r'),(96,0,'adjective','having or showing profound knowledge.','Before the Internet, the library was typically were you would find erudite readers.','Magoosh\r'),(97,0,'verb','avoid and stay away from deliberately; stay clear of.','Politicians are the masters of eschewing morals; academics are the masters of eschewing clarity.','Magoosh\r'),(98,0,'adjective','confined to and understandable by only an enlightened inner circle.','Map collecting is an esoteric hobby to most, but to geography geeks it is a highly enjoyable pasttime.','Magoosh\r'),(99,0,'verb','to adopt or support an idea or cause.','As a college student, Charlie espoused Marxism, growing his beard out and railing against the evils of the free-market.','Magoosh\r'),(100,0,'verb','make worse.','Her sleeplessness exacerbated her cold--when she woke up the next day, her sinuses were completely blocked.','Magoosh\r'),(101,0,'adjective','requiring and demanding accuracy.','Though his childhood piano teacher was so exacting, Max is thankful now, as a professional pianist.','Magoosh\r'),(102,0,'verb','praise or glorify.','The teenagers exalted the rock star, covering their bedrooms with posters of him.','Magoosh\r'),(103,0,'verb','pronounce not guilty of criminal charges.','The document clearly indicated that Nick was out of the state at the time of the crime, and so served to exonerate him of any charges.','Magoosh\r'),(104,0,'verb','add details or explanation; clarify the meaning; state in depth.','The CEO refused to expound on the decision to merge our department with another one, and so I quit.','Magoosh\r'),(105,0,'adjective','the opposite of extinct.','Despite many bookstores closing, experts predict that some form of book dealing will still be extant generations from now.','Magoosh\r'),(106,0,'adjective','of a belief that is based on faulty reasoning.','The widespread belief that Eskimos have forty different words for snow is fallacious, based on one false report.','Magoosh\r'),(107,0,'adjective','overly concerned with details; fussy.','Whitney is fastidious about her shoes, arranging them on a shelf in a specific order, each pair evenly spaced.','Magoosh\r'),(108,0,'verb','try to stir up public opinion.','After having his pay cut, Phil spread vicious rumors about his boss, hoping to foment a general feeling of discontent.','Magoosh\r'),(109,0,'adjective','marked by or showing hopelessness.','After her third pet dog died, Marcia was simply forlorn: this time even the possibility of buying a new dog no longer held any joy.','Magoosh\r'),(110,0,'adjective','available when required or as promised.','The President announced that the senators were about to reach a compromise, and that he was eager to read the forthcoming details of the bill.','Magoosh\r'),(110,0,'adjective','at ease in talking to others.','As a husband, Larry was not forthcoming: if Jill didn\'t demand to know details, Larry would never share them with her.','Magoosh\r'),(111,0,'adjective','occurring by happy chance; having no cause or apparent cause.','While the real objects are vastly different sizes in space, the sun and the moon seem to have the same fortuitous size in the sky.','Magoosh\r'),(112,0,'adjective','not serious in content or attitude or behavior.','Compared to Juliet\'s passionate concern for human rights, Jake\'s non-stop concern about football seems somewhat frivolous.','Magoosh\r'),(113,0,'adjective','not spending much money (but spending wisely).','Monte was no miser, but was simply frugal, wisely spending the little that he earned.','Magoosh\r'),(114,0,'verb','hinder or prevent (the efforts, plans, or desires) of.','I thought I would finish writing the paper by lunchtime, but a number of urgent interruptions served to frustrate my plan. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(115,0,'verb','deny or contradict; speak against or oppose.','I can\'t gainsay a single piece of evidence James has presented, but I still don\'t trust his conclusion.','Magoosh\r'),(116,0,'noun','the trait of being rude and impertinent.','Even though Carly was only recently hired, she had the gall to question her boss\'s judgment in front of the office.','Magoosh\r'),(116,0,'noun','feeling of deep and bitter anger and ill-will.','In an act of gall, Leah sent compromising photos of her ex-boyfriend to all his co-workers and professional contacts.','Magoosh\r'),(117,0,'verb','to excite or inspire (someone) to action.','At mile 23 of his first marathon, Kyle had all but given up, until he noticed his friends and family holding a banner that read, \"Go Kyle\"; galvanized, he broke into a gallop, finishing the last three miles in less than 20 minutes.','Magoosh\r'),(118,0,'adjective','full of trivial conversation.','Lynne was garrulous: once, she had a fifteen minute conversation with a stranger before she realized the woman didn\'t speak English.','Magoosh\r'),(119,0,'adjective','lacking social polish.','Sylvester says the most gauche things, such as telling a girl he liked that she was much prettier when she wore makeup.','Magoosh\r'),(120,0,'adjective','relevant and appropriate.','The professor wanted to tell the jury in detail about his new book, but the lawyer said it wasn\'t germane to the charges in the cases.','Magoosh\r'),(121,0,'noun','an excessive supply.','The Internet offers such a glut of news related stories that many find it difficult to know which story to read first.','Magoosh\r'),(121,0,'verb','supply with an excess of.','In the middle of economic crises, hiring managers find their inboxes glutted with resumes.','Magoosh\r'),(122,0,'adjective','characterized by unusual lightness and delicacy.','The gossamer wings of a butterfly, which allow it to fly, are also a curse, so delicate that they are often damaged.','Magoosh\r'),(123,0,'adjective','to be likely to socialize with others.','Often we think that great leaders are those who are gregarious, always in the middle of a large group of people; yet, as Mahatma Gandhi and many others have shown us, leaders can also be introverted.','Magoosh\r'),(124,0,'adjective','free of deceit.','At first I thought my niece was guileless, but I then found myself buying her ice cream every time we passed a shop.','Magoosh\r'),(125,0,'adjective','lacking significance through having been overused.','Cheryl rolled her eyes when she heard the lecturer\'s hackneyed advice to \"be true to yourself.\".','Magoosh\r'),(126,0,'noun','a long pompous speech; a tirade.','Dinner at Billy\'s was more a punishment than a reward, since anyone who sat at the dinner table would have to listen to Billy\'s father\'s interminable harangues against the government.','Magoosh\r'),(126,0,'verb','to deliver a long pompous speech or tirade.','Tired of his parents haranguing him about his laziness and lack of initiative, Tyler finally moved out of home at the age of thirty-five.','Magoosh\r'),(127,0,'adjective','troubled persistently especially with petty annoyances.','With a team of new hires to train, Martha was constantly harried with little questions and could not focus on her projects.','Magoosh\r'),(128,0,'adjective','having or showing arrogant superiority to and disdain of those one views as unworthy.','The haughty manager didn\'t believe that any of his subordinates could ever have an insight as brilliant his own.','Magoosh\r'),(129,0,'adjective','dominance over a certain area.','Until the Spanish Armada was defeated in 1587, Spain had hegemony over the seas, controlling waters stretching as far as the Americas.','Magoosh\r'),(130,0,'noun','a person who holds unorthodox opinions in any field (not merely religion).','Though everybody at the gym told Mikey to do cardio before weights, Mikey was a heretic and always did the reverse.','Magoosh\r'),(131,0,'noun','somebody who attacks cherished beliefs or institutions.','Lady Gaga, in challenging what it means to be clothed, is an iconoclast for wearing a \"meat dress\" to a prominent awards show.','Magoosh\r'),(132,0,'adjective','defying tradition or convention.','Jackson Pollack was an iconoclastic artist, totally breaking with tradition by splashing paint on a blank canvas.','Magoosh\r'),(133,0,'noun','a behavioral attribute that is distinctive and peculiar to an individual.','Peggy\'s numerous idiosyncrasies include wearing mismatched shoes, laughing loudly to herself, and. owning a pet aardvark.','Magoosh\r'),(134,0,'adjective','dishonorable.','In the 1920s, the World Series was rigged--an ignoble act which baseball took decades to recover from.','Magoosh\r'),(135,0,'adjective','(used of conduct or character) deserving or bringing disgrace or shame.','Since the politician preached ethics and morality, his texting of revealing photographs was ignominious, bringing shame on both himself and his party.','Magoosh\r'),(136,0,'adjective','not able to be changed.','Taxes are one of the immutable laws of the land, so there is no use arguing about paying them.','Magoosh\r'),(137,0,'adjective','free from undue bias or preconceived opinions.','The judge was not impartial since he had been bribed by the witness\'s family.','Magoosh\r'),(138,0,'adjective','being disrespectful; improperly forward or bold.','Dexter, distraught over losing his pet dachshund, Madeline, found the police officer\'s questions impertinent--after all, he thought, did she have to pry into such details as to what Madeline\'s favorite snack was?.','Magoosh\r'),(139,0,'adjective','incapable of making less angry or hostile.','Win or lose, the coach was always implacable, never giving the athletes an easy practice or a break.','Magoosh\r'),(140,0,'adjective','describing a statement that is not believable.','The teacher found it implausible that the student was late to school because he had been kidnapped by outlaws on horseback.','Magoosh\r'),(141,0,'adjective','not wise.','Hitler, like Napoleon, made the imprudent move of invading Russia in winter, suffering even more casualties than Napoleon had.','Magoosh\r'),(142,0,'adjective','improperly forward or bold.','In an impudent move, the defendant spoke out of order to say terribly insulting things to the judge.','Magoosh\r'),(143,0,'adjective','having or demonstrating ability to recognize or draw fine distinctions.','The lawyer had an incisive mind, able in a flash to dissect a hopelessly tangled issue and isolate the essential laws at play.','Magoosh\r'),(144,0,'adjective','lacking in harmony or compatibility or appropriateness.','The vast economic inequality of modern society is incongruous with America\'s ideals.','Magoosh\r'),(145,0,'adjective','impervious to correction by punishment.','Tom Sawyer seems like an incorrigible youth until Huck Finn enters the novel; even Sawyer can\'t match. his fierce individual spirit.','Magoosh\r'),(146,0,'adjective','not in keeping with accepted standards of what is right or proper in polite society.','Eating with elbows on the table is considered indecorous in refined circles.','Magoosh\r'),(147,0,'noun','the trait of seeming not to care.','In an effort to fight indifference, the president of the college introduced a new, stricter grading system.','Magoosh\r'),(148,0,'adjective','impossible to stop or prevent.','The rise of the computer was an inexorable shift in technology and culture.','Magoosh\r'),(149,0,'adjective','to be na ve and innocent.','Two-years in Manhattan had changed Jenna from an ingenuous girl from the suburbs to a jaded urbanite, unlikely to fall for any ruse, regardless of how elaborate.','Magoosh\r'),(150,0,'verb','gain favor with somebody by deliberate efforts.','Even though Tom didn\'t like his new boss, he decided to ingratiate himself to her in order to advance his career.','Magoosh\r'),(151,0,'adjective','hostile (usually describes conditions or environments).','Venus, with a surface temperature that would turn rubber to liquid, is inimical to any form of life.','Magoosh\r'),(152,0,'adjective','harmless and doesn\"t produce any ill effects.','Everyone found Nancy\'s banter innocuous--except for Mike, who felt like she was intentionally picking on him.','Magoosh\r'),(153,0,'adjective','not easily understood; unfathomable.','His speech was so dense and confusing that many in the audience found it inscrutable.','Magoosh\r'),(154,0,'adjective','working in a subtle but destructive way.','Plaque is insidious: we cannot see it, but each day it eats away at our enamel, causing cavities and other dental problems.','Magoosh\r'),(155,0,'adjective','rude and arrogant.','Lilian could not help herself from being insolent, commenting that the Queen\'s shoes were showing too much toe.','Magoosh\r'),(156,0,'verb','to suggest something subtly.','At first Manfred\'s teachers intimated to his parents that he was not suited to skip a grade; when his parents protested, teachers explicitly told them that, notwithstanding the boy\'s precocity, he was simply too immature to jump to the 6th grade. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(157,0,'adjective','unwilling to change one\'s beliefs or course of action.','Despite many calls for mercy, the judge remained intransigent, citing strict legal precedence.','Magoosh\r'),(158,0,'adjective','fearless.','Captain Ahab was an intrepid captain whose reckless and fearless style ultimate leads to his downfall.','Magoosh\r'),(159,0,'adjective','habitual.','He is an inveterate smoker and has told his family and friends that there is no way he will ever quit.','Magoosh\r'),(160,0,'adjective','complicated, and difficult to comprehend.','The physics lecture became so involved that the undergraduate\'s eyes glazed over.','Magoosh\r'),(161,0,'adjective','incapable of being retracted or revoked.','Once you enter your plea to the court, it is irrevocable so think carefully about what you will say.','Magoosh\r'),(162,0,'noun','fanatical patriotism.','North Korea maintains intense control over its population through a combination of jingoism and cult of personality.','Magoosh\r'),(163,0,'adjective','full of or showing high-spirited merriment.','The political candidate and his supporters were jovial once it was clear that she had won.','Magoosh\r'),(164,0,'verb','place side by side.','The meaning of her paintings comes from a classical style which juxtaposes modern themes.','Magoosh\r'),(165,0,'adjective','one who says very few words.','While Martha always swooned over the hunky, laconic types in romantic comedies, her boyfriends inevitably were very talkative--and not very hunky.','Magoosh\r'),(166,0,'verb','criticize severely or angrily.','Showing no patience, the manager utterly lambasted the sales team that lost the big account.','Magoosh\r'),(167,0,'adjective','not inclined towards physical exertion or effort; slow and relaxed.','As the sun beat down and the temperature climbed higher, we spent a languid week lying around the house.','Magoosh\r'),(168,0,'noun','extreme generosity and giving.','Uncle Frank was known for his largess, so his nephew was sad when he did not receive a present for his birthday.','Magoosh\r'),(169,0,'adjective','worthy of high praise.','To say that Gandhi\'s actions were laudable is the greatest understatement; he overthrew an empire without violence.','Magoosh\r'),(170,0,'verb','assign great social importance to.','Students in the U.S. learn to lionize Jefferson, Franklin, and Washington because they are the founding fathers of the nation.','Magoosh\r'),(171,0,'adjective','noble and generous in spirit, especially towards a rival or someone less powerful.','He was a great sportsman: in defeat he was complementary and in victory he was magnanimous.','Magoosh\r'),(172,0,'verb','to assert.','The scientist maintained that the extinction of dinosaurs was most likely brought about by a drastic change in climate.','Magoosh\r'),(173,0,'adjective','clumsy.','As a child she was quite maladroit, but as an adult, she has become an adept dancer. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(174,0,'noun','someone who exhibits great independence in thought and action.','Officer Kelly was a maverick, rarely following police protocols or adopting the conventions for speech common among his fellow officers.','Magoosh\r'),(175,0,'adjective','overly sentimental to the point that it is disgusting.','The film was incredibly mawkish, introducing highly likeable characters only to have them succumb to a devastating illnesses by the end of the movie.','Magoosh\r'),(176,0,'noun','the tendency to be untruthful.','I can forgive her for her mendacity but only because she is a child and is seeing what she can get away with.','Magoosh\r'),(177,0,'adjective','(of a person) prone to unexpected and unpredictable changes in mood.','The fact that Ella\'s moods were as mercurial as the weather was problematic for her relationships--it didn\'t help that she lived in Chicago.','Magoosh\r'),(178,0,'adjective','marked by extreme care in treatment of details.','The Japanese noodle maker was meticulous in making his noodles and would never let another person take over the task.','Magoosh\r'),(179,0,'verb','interpret in the wrong way.','The politician never trusted journalists because he though that they misconstrue his words and misrepresent his positions.','Magoosh\r'),(180,0,'verb','make less severe or harsh.','I can only spend so much time mitigating your disagreements with your wife, and at certain point, you need to do it on your own.','Magoosh\r'),(180,0,'verb','lessen the severity of an offense.','If it weren\'t for the mitigating circumstances, he would have certainly lost his job.','Magoosh\r'),(181,0,'verb','to make someone angry less angry; placate.','In the morning, Harriat was unable to mollify Harry, if he happened to become angry, unless he had his cup of coffee.','Magoosh\r'),(182,0,'adjective','repetitive and boring; not spiritual.','Nancy found doing dishes a thorougly mundane task, although Peter found a kind of Zen pleasure in the chore.','Magoosh\r'),(182,0,'adjective','relating to the ordinary world.','Though we think of the pope as someone always dealing in holy matters, he is also concerned with mundane events, such as deciding when to set his alarm each morning.','Magoosh\r'),(183,0,'adjective','very generous.','Uncle Charley was known for his munificence, giving all seven of his nephews lavish Christmas presents each year.','Magoosh\r'),(184,0,'adjective','lacking foresight or imagination.','The company ultimately went out of business because the myopic managers couldn\'t predict the changes in their industry. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(185,0,'noun','a large indefinite number.','There are a myriad of internet sites hawking pills that claim to boost energy for hours on end.','Magoosh\r'),(186,0,'adjective','so small as to be meaningless; insignificant.','The GRE tests cumulative knowledge, so if you cram the night before it is, at best, likely to only have a negligible impact on your score.','Magoosh\r'),(187,0,'verb','unsure how to act or respond.','Shirley was totally nonplussed when the angry motorist cut her off and then stuck his finger out the window.','Magoosh\r'),(188,0,'noun','a subtle difference in meaning or opinion or attitude.','Because of the nuances involved in this case, I hired an outside consultant to advice us and help.','Magoosh\r'),(189,0,'verb','make unclear.','On the Smith\'s drive through the Grand Canyon, Mr. Smith\'s big head obscured much of Mrs. Robinson\'s view, so that she only saw momentary patches of red rock. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(189,0,'adjective','known by only a few.','Many of the biggest movie stars were once obscure actors who got only bit roles in long forgotten films. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(190,0,'adjective','attentive in an ingratiating or servile manner; attempting to win favor from influential people by flattery.','The obsequious waiter did not give the couple a moment\'s peace all through the meal, constantly returning to their table to refill their water glasses and to tell them what a handsome pair they made.','Magoosh\r'),(191,0,'adjective','not clearly understood or expressed.','The meaning of the professor\'s new research was opaque to most people, so no one asked any questions. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(192,0,'noun','wealth as evidenced by sumptuous living.','Russian oligarchs are famous for their opulence, living in fancy homes and dining on expensive cavier.','Magoosh\r'),(193,0,'adjective','intended to attract notice and impress others; tawdry or vulgar.','Matt wanted to buy stone lions for front of the house, but Cynthia convinced him that such a display would be too ostentatious for a modest house in an unassuming neighborhood.','Magoosh\r'),(194,0,'verb','exclude from a community or group.','Later in his life, Leo Tolstoy was ostracized from the Russian Orthodox Church for his writings that contradicted church doctrine.','Magoosh\r'),(195,0,'noun','distinctive and stylish elegance.','Jim, with his typical panache, came to the wedding reception with a top hat, a cane, and a long cape covered in sequins.','Magoosh\r'),(196,0,'adjective','narrowly restricted in scope or outlook.','Jasmine was sad to admit it, but her fledgling relationship with Jacob did not work out because his culinary tastes were simply too parochial; \"After all,\" she quipped on her blog, \"he considered Chef Boyardee ethnic food.\".','Magoosh\r'),(197,0,'adjective','extremely frugal; miserly.','Katie is so parsimonious that she only buys a pair of socks if all of her other socks have holes in them.','Magoosh\r'),(198,0,'adjective','lacking imagination.','While Nan was always engaged in philosophical speculation, her brother was occupied with far more pedestrian concerns: how to earn a salary and run a household. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(199,0,'adjective','expressing disapproval (usu.','refers to a term). Most psychologists object to the pejorative term \"shrink\", believing that they expand the human mind, not limit it. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(200,0,'noun','an act of deliberate betrayal; a breach of a trust.','The lowest circles in Dante\'s Inferno were for those who had practiced perfidy, and among these, the very lowest was for those, such as Judas, who had been treacherous to one of their benefactors.','Magoosh\r'),(201,0,'adjective','easily irritated or annoyed.','When Ed first met Ruth, he didn\'t realize she was so petulant, but now that they are three months into their relationship, Ed feels a day doesn\'t go by in which she isn\'t whining about some minor issue.','Magoosh\r'),(202,0,'verb','cause to be more favorably inclined; gain the good will of.','I was able to placate the angry mob of students by promising to bring cookies on Monday.','Magoosh\r'),(203,0,'noun','a trite or obvious remark.','The professor argued that many statements regarded as wise in previous times, such as the Golden Rule, are now regarded as mere platitudes.','Magoosh\r'),(204,0,'adjective','emotionally touching.','After the Montagues and Capulets discover the dead bodies of Romeo and Juliet, in the play\'s most poignant moment, the two griefstricken familes agree to end their feud once and for all. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(205,0,'noun','a strong verbal or written attack on someone or something.','The professor launched into a polemic, claiming that Freudian theory was a pack of lies that absolutely destroyed European literary theory. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(206,0,'verb','assume as fact.','Initially, Einstein posited a repulsive force to balance Gravity, but then rejected that idea as a blunder.','Magoosh\r'),(207,0,'adjective','guided by practical experience and observation rather than theory.','Rather than make a philosophical appeal to the Congressmen, the Speaker decided to take a far more pragmatic approach, making small side-deals that would add votes to his bill.','Magoosh\r'),(208,0,'adjective','done with very great haste and without due deliberation.','He was expecting a precipitous rise in the value of a \"hot\" tech stock, so he was disappointed when it only inched up a dollar or two each day.','Magoosh\r'),(209,0,'verb','keep from happening or arising; make impossible.','The manager specified that all other gates be locked, to preclude the possibility of persons without tickets entering the arena undetected.','Magoosh\r'),(210,0,'adjective','characterized by or characteristic of exceptionally early development or maturity (especially in mental aptitude).','Though only seven years old, she was a precocious chess prodigy, able to beat players twice her age.','Magoosh\r'),(211,0,'noun','a strong liking.','Monte had a predilection for the fine things in life: Cuban cigars, 200 dollar bottles of wine, and trips to the French Riviera.','Magoosh\r'),(212,0,'noun','the power to foresee the future.','Baxter\'s warnings about investing in technology stocks seemed like an act of prescience after the whole market declined significantly.','Magoosh\r'),(213,0,'verb','to speak in an evasive way.','The cynic quipped, \"There is not much variance in politicians; they all seem to prevaricate\".','Magoosh\r'),(214,0,'adjective','rashly or wastefully extravagant.','Successful professional athletes who do not fall prey to prodigality seem to be the exception--most live decadent lives.','Magoosh\r'),(215,0,'adjective','so great in size or force or extent as to elicit awe.','After the relatively small homerun totals in the \"dead ball\" era, Babe Ruth\'s homerun totals were truly prodigious: every year, he set a new all-time record.','Magoosh\r'),(216,0,'noun','someone who spends money recklessly or wastefully.','Most lottery winners go from being conservative, frugal types to outright profligates who blow millions on fast cars, lavish homes, and giant yachts.','Magoosh\r'),(217,0,'adjective','intellectually productive.','Schubert was the most prolific composer, producing hundreds of hours of music before he died at the age of 31.','Magoosh\r'),(218,0,'noun','someone who has been admitted to membership in a scholarly field.','Steven Pinker\'s credentials are unquestioned as a pundit; he has taught at MIT and Stanford, teaches at Harvard, and has published a number of influential books on cognition, language, and psychology.','Magoosh\r'),(219,0,'adjective','to be legally competent or capable.','If James had made more than $50,000 last year, then he wouldn\'t have qualified for the low-income scholarship.','Magoosh\r'),(219,0,'verb','to make less severe; to limit (a statement).','Chris qualified his love for San Francisco, adding that he didn\'t like the weather as much as the weather in Los Angeles.','Magoosh\r'),(220,0,'adjective','habitually complaining.','The querulous old woman was begining to wear down even the happier members of the staff with her ceaseless complaining.','Magoosh\r'),(221,0,'adjective','found in the ordinary course of events.','Phil gets so involved thinking about Aristotle\'s arguments that he totally forgets quotidian concerns, such as exercising and eating regularly.','Magoosh\r'),(222,0,'adjective','extremely hungry; devouring or craving food in great quantities.','John didn\'t each much at all during the week he had the flu, so now that he is regaining his health, it\'s not surpring that he has a ravenous appetite.','Magoosh\r'),(223,0,'verb','criticize severely or angrily; censure.','The police chief rebuked the two officers whose irresponsible decisions almost led to the deaths of seven innocent by-standers.','Magoosh\r'),(224,0,'verb','make (one thing) compatible with (another).','Peggy was unable to reconcile her kind friend Jane with the cruel and merciless character Jane played on television.','Magoosh\r'),(225,0,'adjective','difficult to penetrate; incomprehensible to one of ordinary understanding or knowledge.','I found Ulysses recondite and never finished the book, waiting instead to read it with someone else so we could penetrate its meaning together.','Magoosh\r'),(226,0,'adjective','stubbornly resistant to authority or control.','Used to studious high school students, Martha was unprepared for the refractory Kindgergarteners who neither sat still nor listened to a single word she said. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(227,0,'verb','prove to be false or incorrect.','No one could refute his theories or propositions, and that is why he was esteemed by all his colleagues in the philosophy department.','Magoosh\r'),(228,0,'verb','to express criticism towards.','At first, Sarah was going to yell at the boy, but she didn\'t want to reproach him for telling the truth about the situation.','Magoosh\r'),(229,0,'verb','reject as untrue or unfounded.','Many in the public believed the rumors of a UFO crash outside town, so the chief of police did everything he could to repudiate the rumors.','Magoosh\r'),(230,0,'verb','cancel officially.','The man\'s driver\'s license was rescinded after his tenth car accident, which meant he would never be allowed to legally drive again.','Magoosh\r'),(231,0,'adjective','restless.','The crowd grew restive as the comedian\'s opening jokes fell flat.','Magoosh\r'),(232,0,'adjective','rising again as to new life and vigor.','The team sank to fourth place in June, but is now resurgent and about to win the division.','Magoosh\r'),(233,0,'adjective','feeling or showing profound respect or veneration.','The professor could speak objectively about the other composers, but he always lectured about Brahms with a particularly reverent air, unable to offer a single criticism of his compositions.','Magoosh\r'),(234,0,'adjective','being in the earliest stages of development; being or involving basic facts or principles.','I would love to be able to present a fully polished proposal to the board, but right now, our plans for the product are still in the most rudimentary stages.','Magoosh\r'),(235,0,'adjective','characteristic of rural life; awkwardly simple and provincial.','The vacation cabin had no electricity and no indoor plumbing, but despite these inconveniences, Nigel adored its rustic charm.','Magoosh\r'),(236,0,'verb','give authority or permission to.','The authorities have sanctioned the use of the wilderness reserve for public use; many expect to see. hikers an campers enjoying the park in the coming months.','Magoosh\r'),(236,0,'noun','a legal penalty for a forbidden action.','International sanctions have been placed on certain shipping lanes that were thought to be involved in human trafficking.','Magoosh\r'),(237,0,'adjective','characterized by extreme care and great effort.','Because of his scrupulous nature, Mary put him in charge of numbering and cataloging the entire collection of rare stamps.','Magoosh\r'),(237,0,'adjective','having a sense of right and wrong; principled.','Everyone trusted what he said and followed his example because he was scrupulous and honest.','Magoosh\r'),(238,0,'adjective','inducing mental lethargy; sleep inducing.','Although the professor is brilliant, his bland monotone gives his lectures a soporific effect.','Magoosh\r'),(239,0,'adjective','plausible but false.','He made a career out of specious arguments and fictional lab results, but lost his job and reputation when his lies were exposed by an article in The New York Times.','Magoosh\r'),(240,0,'adjective','recurring in scattered and irregular or unpredictable instances.','The signals were at first sporadic, but now we detect a clear, consistent pattern of electromagnetic radiation eminating from deep space.','Magoosh\r'),(241,0,'adjective','plausible but false.','When listening to a politician speak, it is hard to distinguish the spurious claims from the authentic ones.','Magoosh\r'),(242,0,'adjective','firm and dependable especially in loyalty.','No longer a staunch supporter of the movement, Todd now will openly question whether its goals are worthwhile.','Magoosh\r'),(243,0,'adjective','demanding strict attention to rules and procedures.','Most of the students disliked the teacher because of his stringent homework policy, but many students would later thank him for demanding so much from them.','Magoosh\r'),(244,0,'verb','contain or include.','The rogue wave quickly subsumed the pier and boardwalk, destroying everything in its path.','Magoosh\r'),(244,0,'verb','consider (an instance of something) as part of a general rule or principle.','Don Quixote of La Mancha subsumes all other modern novels, demonstrating modern literary devices. and predating even the idea of a postmodern, metanarrative.','Magoosh\r'),(245,0,'adjective','in opposition to a civil authority or government.','The ruling political party has begun a campaign to shut down subversive websites that it deems as a threat to \"national safety.\".','Magoosh\r'),(246,0,'adjective','showing a brooding ill humor.','Herbert took board games too seriously, often appearing sullen after losing.','Magoosh\r'),(247,0,'adjective','serving no useful purpose.','How can we hope to stay open if we don\'t eliminate all superfluous spending, like catered meetings and free acupucture Tuesday?.','Magoosh\r'),(248,0,'verb','take the place or move into the position of.','For many, a cell phone has supplanted a traditional phone; in fact, most 20-somethings don\'t even have a traditional phone anymore.','Magoosh\r'),(249,0,'adjective','habitually reserved and uncommunicative.','While the CEO enthusiastically shares his plans and agenda with all who will listen, the CFO is far more taciturn, rarely revealing his perspective.','Magoosh\r'),(250,0,'adjective','being essentially equal to something.','In many situations, remaining silent is tantamount to admitting guilt, so speak to prove your innocence.','Magoosh\r'),(251,0,'noun','the trait of avoiding excesses.','Welles wasn\'t known for his temperance--he usually ate enough for two and drank enough for three.','Magoosh\r'),(252,0,'adjective','moderated in effect.','The wide-eyed optimism of her youth was now tempered after she had worked many years in the criminal justice system.','Magoosh\r'),(253,0,'adjective','stubbornly unyielding.','Even the most tenacious advocates for gun ownership must admit some of the dangers that firearms present.','Magoosh\r'),(254,0,'adjective','timid by nature or revealing fear and nervousness.','Since this was her first time debating on stage and before an audience, Di\'s voice was timorous and quiet for the first 10 minutes.','Magoosh\r'),(255,0,'noun','inactivity resulting from lethargy and lack of vigor or energy.','After work, I was expecting my colleagues to be enthusiastic about the outing, but I found them in a state of complete torpor.','Magoosh\r'),(256,0,'adjective','marke