ther King Jr. was a tireless advocate for the rights of African-Americans in the United States. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(282,0,'adjective','likeable; easy to talk to.','For all his surface affability, Marco was remarkably glum when he wasn\'t around other people.','Magoosh\r'),(283,0,'adjective','wealthy.','The center of the city had sadly become a pit of penury, while, only five miles away, multi-million dollar homes spoke of affluence.','Magoosh\r'),(284,0,'noun','the quality of unselfish concern for the welfare of others.','Albert Schweitzer spent most of his life doing missionary work as a doctor in Africa, seeking no reward, apparently motivated only by altruism.','Magoosh\r'),(285,0,'adjective','friendly.','Amy\'s name was very apt: she was so amiable that she was twice voted class president.','Magoosh\r'),(286,0,'adverb','more than is adequate.','The boat was amply supplied for its year at sea--no man would go hungry or thirst.','Magoosh\r'),(287,0,'adverb','in a frenzied or uncontrolled state.','Wherever the bowl haircut teen-idol went, his legions of screaming fans ran through the streets amuck, hoping for a glance at his boyish face.','Magoosh\r'),(288,0,'adjective','similar in some respects but otherwise different.','In many ways, the Internet\'s transformative effect on society has been analogous to that of the printing press.','Magoosh\r'),(289,0,'noun','intense hostility.','The governor\'s animosity toward his rival was only inflamed when the latter spread false lies regarding the governor\'s first term.','Magoosh\r'),(290,0,'verb','precede in time.','Harry was so unknowledgable that he was unaware the Egyptian pharaohs antedated the American Revolution.','Magoosh\r'),(291,0,'adjective','old-fashioned; belonging to an earlier period in time.','Aunt Betty had antiquated notions about marriage, believing that a man should court a woman for at least a year before receiving a kiss.','Mag