ect manner.','Not one for social pleasantries, the Chief of Staff would brusquely ask his subordinates anything he wanted, even coffee.','Magoosh\r'),(321,0,'verb','resist.','The profits at our firm bucked the general downturn that effected the real estate industry. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(322,0,'verb','make stronger or defensible.','China\'s economy has been buttressed by a global demand for the electronic parts the country manufactures.','Magoosh\r'),(323,0,'adjective','emaciated; gaunt.','Some actors take challenging roles in which they have to lose so much weight that they appear cadaverous.','Magoosh\r'),(324,0,'adjective','a straightforward and honest look at something.','Even with a perfect stranger, Charles was always candid and would rarely hold anything back.','Magoosh\r'),(325,0,'noun','the quality of being honest and straightforward in attitude and speech.','Although I was unhappy that the relationship ended, I appreciated her candidness about why she was ready to move on from the relationship.','Magoosh\r'),(326,0,'adjective','of primary importance; fundamental.','Most cultures consider gambling a cardinal sin and thus have outlawed its practice. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(327,0,'adjective','persistently petty and unjustified criticism.','What seemed like incessant nagging and carping about my behavior from my mother turned out to be wise and useful advice that has served me well.','Magoosh\r'),(328,0,'noun','something that speeds up an event.','Rosa Park\'s refusal to give up her bus seat acted as a catalyst for the Civil Rights Movement, setting into motion historic changes for African-Americans.','Magoosh\r'),(329,0,'verb','to examine and remove objectionable material.','Every fall, high school English teachers are inundated by requests to censor their curriculum by removing The Catcher in the Rye and Scarlet Lett