nal moments of the trial, during his closing speech, Phillips was nearly begging the judge for clemency.','Magoosh\r'),(337,0,'verb','fuse or cause to grow together.','Over time, the various tribes coalesced into a single common culture with one universal language.','Magoosh\r'),(338,0,'adjective','clear and persuasive.','A cogent argument will change the minds of even the most skeptical audience.','Magoosh\r'),(339,0,'adjective','well integrated, forming a united whole.','A well-written, cohesive essay will keep on topic at all times, never losing sight of the main argument.','Magoosh\r'),(340,0,'noun','agreement on a secret plot.','Many have argued that Lee Harvey Oswald, JFK\'s assassin, was in collusion with other criminals; others maintain that Oswald was a lone gunman.','Magoosh\r'),(341,0,'adjective','so great in size or force or extent as to elicit awe.','Few appreciate the colossal scale of the sun: if hollow, it could contain a million Earths.','Magoosh\r'),(342,0,'adjective','worthy of high praise.','The efforts of the firefighters running into the burning building were commendable.','Magoosh\r'),(343,0,'adjective','contented to a fault with oneself or one\'s actions.','After the water polo team won their sixth championship, they became complacent and didn\'t even make it to the playoffs the next year.','Magoosh\r'),(344,0,'adjective','enhancing each other\'s qualities (for two things or more).','The head waiter was careful to tell the amateur diners that red wine was complementary with beef, each bringing out subtle taste notes in the other.','Magoosh\r'),(345,0,'verb','make more intense, stronger, or more marked.','Her headache was compounded by the construction crew outside, which had six jackhammers going at the same time. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(346,0,'adjective','making a situation or outcome more likely to happen.','Studying in a quiet room is conducive to learning; studying in 