securities that inhibited personal growth. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(391,0,'verb','to trick or swindle.','Once again a get-rich-fast Internt scheme had duped Harold into submitting a $5,000 check to a sham operation.','Magoosh\r'),(391,0,'noun','a person who is easily tricked or swindled.','The charlatan mistook the crowd for a bunch of dupes, but the crowd was quickly on to him and decried his bald-faced attempt to bilk them.','Magoosh\r'),(392,0,'adjective','highly unconventional or usual (usually describes a person).','Mozart was well-known for his eccentricities, often speaking words backward to confuse those around him.','Magoosh\r'),(393,0,'noun','a conceited and self-centered person.','An egotist, Natasha had few friends because of her inability to talk about anything except her dream of becoming the next American Idol.','Magoosh\r'),(394,0,'verb','To live off meager resources, to scrape by.','Stranded in a cabin over the winter, Terry was able to eke out an existence on canned food.','Magoosh\r'),(395,0,'adjective','marked by complexity and richness of detail.','Thomas, on returning from Morocco, replaced his dirty gray carpet with an elaborate one he\'d brought back with him.','Magoosh\r'),(395,0,'verb','explain in more detail.','Most high school physics teachers find themselves elaborating the same point over and over again, since many concepts confuse students.','Magoosh\r'),(396,0,'verb','escape understanding.','Even a basic understanding of physics can elude most high schools students.','Magoosh\r'),(397,0,'adjective','difficult to capture or difficult to remember.','Many first time skydivers say that describing the act of falling from the sky is elusive.','Magoosh\r'),(398,0,'verb','make more attractive by adding ornament, colour, etc.','; make more beautiful McCartney would write relatively straightforward lyrics, and Lennon would embellish them with puns and poetic images.','Magoosh