ss was an extenuating factor in his crime of dognapping a prized pooch.','Magoosh\r'),(417,0,'adjective','cleverly amusing in tone.','Facetious behavior will not be tolerated during sex eduation class; it\'s time for all of you to treat these matters like mature adults.','Magoosh\r'),(418,0,'verb','try to gain favor by extreme flattery.','The media fawned over the handsome new CEO, praising his impeccable sense of style instead of asking more pointed questions. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(419,0,'verb','to search for something persistently.','Ever the resourceful lexicographer, Fenton was able to ferret out the word origin of highly obscure words. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(420,0,'verb','to celebrate a person.','After World War II, war heroes were feted at first but quickly forgotten.','Magoosh\r'),(421,0,'adjective','liable to sudden unpredictable change, esp.','in affections or attachments. She was so fickle in her politics, it was hard to pinpoint her beliefs; one week she would embrace a side, and the next week she would denounce it.','Magoosh\r'),(422,0,'verb','achieve something by means of trickery or devious methods.','Steven was able to finagle one of the last seats on the train by convincing the conductor that his torn stub was actually a valid ticket.','Magoosh\r'),(423,0,'verb','to deceive.','Many people have been fleeced by Internet scams and never received their money back. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(424,0,'verb','behave awkwardly; have difficulties.','Sylvia has excelled at advanced calculus, but ironically, when she has deal with taxes, she flounders.','Magoosh\r'),(425,0,'adjective','to be in abundance.','The exam\'s passage is flush with difficult words, words that you may have learned only yesterday.','Magoosh\r'),(426,0,'noun','a behavioral attribut