gan to collect in pools on the highway, it began to hamper the flow of traffic. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(437,0,'verb','made ineffective or powerless.','The FBI has made so many restriction on the local police that they are absolutely hamstrung, unable to accomplish anything.','Magoosh\r'),(438,0,'noun','the pinnacle or top of a time period or career.','During the heyday of Prohibition, bootlegging had become such a lucrative business that many who had been opposed to the 18th Amendment began to fear it would be repealed.','Magoosh\r'),(439,0,'noun','a confusing mixture or jumble.','Those in attendance represented a hodgepodge of the city\'s denizens: chimney sweepers could be seen sitting elbow to elbow with stockbrokers.','Magoosh\r'),(440,0,'verb','to pursue relentlessly.','An implacable foe of corruption, Eliot Ness hounded out graft in all forms--he even helped nab Al Capone. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(441,0,'adjective','dull and lacking excitement.','Having grown up in a humdrum suburb, Jacob relished life in New York City after moving.','Magoosh\r'),(442,0,'adjective','contrary to or forbidden by law.','Though Al Capone was engaged in many illicit activities, he was finally arrested for income tax evasion, a relatively minor offense.','Magoosh\r'),(443,0,'adjective','not relevant.','The judge found the defendant\'s comments immaterial to the trial, and summarily dismissed him from the witness stand.','Magoosh\r'),(444,0,'adjective','without fault or error.','He was impeccably dressed in the latest fashion without a single crease or stain.','Magoosh\r'),(445,0,'verb','be a hindrance or obstacle to.','Since the police sergeant had to train the pair of new hires, progress in his own case was impeded.','Magoosh\r'),(446,0,'adjective','close in time; about to occur.','The impending doom of our world has been a discussed and debat