njoy the sun.','Magoosh\r'),(455,0,'adjective','used of persons or behavior; showing no mercy.','Marcus Aurelius, though a fair man, was inclement to Christians during his reign, persecuting them violently.','Magoosh\r'),(456,0,'adjective','necessary (for someone) as a duty or responsibility.','Middle managers at times make important decisions, but real responsibility for the financial well-being of the corporation is ultimately incumbent on the CEO.','Magoosh\r'),(457,0,'verb','to formally charge or accuse of wrong-doing.','The bankrobber was indicted on several major charges, including possession of a firearm.','Magoosh\r'),(458,0,'adjective','originating in a certain area.','The plants and animals indigenous to Australia are notably different from those indigenous to the U.S-- one look at a duckbill platypus and you know you\'re not dealing with an opossum.','Magoosh\r'),(459,0,'adjective','feeling anger over a perceived injustice.','When the cyclist swerved into traffic, it forced the driver to brake and elicited an indignant shout of \"Hey, punk, watch where you\'re going!\".','Magoosh\r'),(460,0,'adjective','characterized by hard work and perseverance.','Pete was an industrious student, completing every assignment thoroughly and on time.','Magoosh\r'),(461,0,'adjective','extremely controversial, incendiary.','It only takes one person to leave an inflammable comment on an Internet thread for that thread to blow up into pages upon pages of reader indignation.','Magoosh\r'),(462,0,'noun','the power of creative imagination.','Daedalus was famous for his ingenuity; he was able to fashion his son Icarus with a pair of wings, using wax to hold them together.','Magoosh\r'),(463,0,'noun','a slight suggestion or vague understanding.','Lynne speaks four Romance languages, but she doesn\'t have an inkling about how East Asian languages are structured.','Magoosh\r'),(464,0,'adjective','dull and uninteresting.','The movie director was known for hiring beautiful actors in order to deflect attention away from the insipid scripts he would typically use.','Magoosh\r'),(465,0,'adjective','unable to pay one\'s bills; bankrupt.','With credit card bills skyrocketing, a shockingly large number of Americans are truly insolvent.','Magoosh\r'),(466,0,'adjective','stopping and starting at irregular intervals.','The intermittent thunder continued and the night was punctuated by cracks of lightning--a surreal sleepless night.','Magoosh\r'),(467,0,'verb','to flood or overwhelm.','The newsroom was inundated with false reports that only made it more difficult for the newscasters to provide an objective account of the bank robbery.','Magoosh\r'),(468,0,'adjective','quickly aroused to anger.','If Arthur\'s dog is not fed adequately, he becames highly irascible, even growling at his own shadow.','Magoosh\r'),(469,0,'verb','irritate or vex.','My little sister has a way of irking and annoying me like no other person.','Magoosh\r'),(470,0,'adjective','uncertain how to act or proceed.','He stood irresolute at the split in the trail, not sure which route would lead back to the camp.','Magoosh\r'),(471,0,'noun','a characteristic language of a particular group.','To those with little training in medicine, the jargon of doctors can be very difficult to understand.','Magoosh\r'),(472,0,'adjective','characterized by jokes and good humor.','My uncle was always in a jocular mood at family gatherings, messing up people\'s hair and telling knock- knock jokes to anyone who would listen.','Magoosh\r'),(473,0,'noun','an aggressive takeover by a group (usually military).','As dangerous of a threat as North Korea is, some analysts believe that were a junta suddenly to gain power, it could be even more unpredictable and bellicose than the current leadership.','Magoosh\r'),(474,0,'adjective','openly distrustful and unwilling to confide.','Without checking his references and talking to previous employers, I am leery of hiring the candidate.','Magoosh\r'),(475,0,'adjective','lacking energy.','Nothing can make a person more lethargic than a big turkey dinner.','Magoosh\r'),(476,0,'adjective','(of language) transparently clear; easily understandable.','Though Walters writes about physics and time travel, his writing is always lucid, so readers with little scientific training can understand difficult concepts.','Magoosh\r'),(477,0,'adjective','suggesting the horror of death and decay; gruesome.','Edgar Allen Poe was considered the master of the macabre; his stories vividly describe the moment leading up to--and often those moments after--a grisly death.','Magoosh\r'),(478,0,'noun','a disease or sickness.','The town was struck by a malady throughout the winter that left most people sick in bed for two weeks.','Magoosh\r'),(479,0,'adjective','capable of being shaped or bent or drawn out.','The clay became malleable and easy to work with after a little water was added.','Magoosh\r'),(479,0,'adjective','easily influenced.','My little brother is so malleable that I can convince him to sneak cookies from the cupboard for me.','Magoosh\r'),(480,0,'adjective','having an unpleasant smell.','Some thermally active fountains spew sulfur fumes--the air around them is sometimes so malodorous that many have to plug their noses.','Magoosh\r'),(481,0,'adjective','suggesting war or military life.','Americans tend to remember Abraham Lincoln as kindly and wise, not at all martial, despite the fact that he was involved in the fiercest war America has even fought.','Magoosh\r'),(482,0,'noun','a short saying expressing a general truth.','Johnson initially suggests that the secret to business can be summarized in a single maxim but then requires a 300-page book to explain exactly what he means.','Magoosh\r'),(483,0,'verb','to wander aimlessly.','A casual observer might have thought that Peter was meandering through the city, but that day he was actually seeking out those places where he and his long lost love had once visited.','Magoosh\r'),(484,0,'noun','a deep, 