matic change in a seamless and barely noticeable fashion.','The earnestness of the daytime talk shows of the 1970\'s has morphed into something far more sensational and vulgar: today guests actually standup and threaten to take swings at one another.','Magoosh\r'),(494,0,'adjective','softened, subdued.','Helen preferred muted earth colors, such as green and brown, to the bright pinks and red her sister liked. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(495,0,'adjective','stubbornly persistent in changing an opinion or action.','No number of pleas and bribes would get him to change his obdurate attitude.','Magoosh\r'),(496,0,'adjective','showing a cheerful willingness to do favors for others.','Even after all his success, I found him to be accommodating and obliging, sharing with me his \"secret tips\" on how to gain wealth and make friends.','Magoosh\r'),(497,0,'adjective','resistant to guidance or discipline; stubbornly persistent.','The coach suggested improvements Sarah might make on the balance beam, but she remained obstinate, unwilling to modify any of the habits that made her successful in the past.','Magoosh\r'),(498,0,'adjective','marked by elaborate rhetoric and elaborated with decorative details.','The ornate Victorian and Edwardian homes spread throughout San Francisco are my favorite part of the city.','Magoosh\r'),(499,0,'adjective','seemingly contradictory but nonetheless possibly true.','That light could be both a particle and a wave seems paradoxical, but nonetheless, it is true.','Magoosh\r'),(500,0,'adjective','relating to the countryside in a pleasant sense.','Those who imagine America\'s countryside as a pastoral region are often disappointed to learn that much of rural U.S. is filled with cornfields extending as far as the eye can see.','Magoosh\r'),(501,0,'verb','treat condescendingly.','She says she genuinely wanted to help me, but instead she patronized me, constantly pointing out how I was 