. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(511,0,'noun','the highest point.','At its pinnacle, the Roman Empire extended across most of the landmass of Eurasia, a feat not paralleled to the rise of the British Empire in the 18th and 19th century.','Magoosh\r'),(512,0,'adjective','having an agreeably pungent taste.','The chef, with a mere flick of the salt shaker, turned the bland tomato soup into a piquant meal.','Magoosh\r'),(513,0,'adjective','concise and full of meaning.','I enjoy reading the Daodejing for its pithy and insightful prose; it always gives me something to think about.','Magoosh\r'),(514,0,'noun','a small amount (of money).','Vinny\'s uncle beamed smugly about how he\'d offered his nephew fifty dollars for his Harvard tuition; even twice the amount would have been a mere pittance.','Magoosh\r'),(515,0,'adjective','not easily irritated.','Doug is normally placid, so we were all shocked to see him yelling at the television when the Mets lost the game.','Magoosh\r'),(516,0,'adjective','(of movement) slow and laborious.','Charlie may seem to run at a plodding pace, but he is an ultramarathoner, meaning he runs distances of up to 100 miles, and can run for ten hours at a stretch.','Magoosh\r'),(517,0,'noun','a clever plan to turn a situation to one\'s advantage.','Dennis arranged an elaborate ploy, involving 14 different people lying for him in different situations, so that it could appear that he was meeting Mary completely by chance at the wedding reception.','Magoosh\r'),(518,0,'noun','an informal meeting or discussion.','Before the team takes the field, the coach always calls for a powwow so that he can make sure all the players are mentally in the right place.','Magoosh\r'),(519,0,'adjective','fraught with danger.','People smoke to relax and forget their cares, but ironically, in terms of health risks, smoking is far more precarious than either mountain-climbing or skydiving.','Magoosh\r'),(520,0,'noun','an example that is used to justify similar occurrences at a later time.','The principal explained that even though one student had done modelling work outside of school, the outfits that student wore in those photographs in no way established a precedent for what could be worn at school dances.','Magoosh\r'),(521,0,'verb','take the place of or have precedence over.','A governmental warning about an imminent terrorist attack would preempt ordinary network programming on television.','Magoosh\r'),(522,0,'adjective','done before someone else can do it.','Just as Martha was about to take the only cookie left on the table, Noah preemptively swiped it.','Magoosh\r'),(523,0,'noun','an assumption that is taken for granted.','When Mr. Baker found out the family car was gone, he acted under the presumption that his rebellious son had taken the car, calling his son\'s phone and yelling at him; only later did Mr. Baker realize that Mrs. Baker had simply gone out to get her nails d.','Magoosh\r'),(523,0,'noun','audacious (even arrogant) behavior that you have no right to.','The new neighbor quickly gained a reptuation for her presumption; she had invited herself to several of the neighbors homes, often stopping over at inopportune times and asking for a drink.','Magoosh\r'),(524,0,'adjective','excessively forward.','Many felt that Barney was presumptuous in moving into the large office before the management even made any official announcement of his promotion.','Magoosh\r'),(525,0,'verb','prove superior.','Before the cricket match, Australia was heavily favored, but India prevailed.','Magoosh\r'),(526,0,'adjective','Unspoiled, untouched (usu.','of nature). The glacial lake was pristine and we filled our canteens to drink deeply.','Magoosh\r'),(526,0,'adjective','Immaculately clean and unused.','Drill sergeants are known for demanding pristine cabinets, uniforms, and beds, and often make new recruits clean and clean and clean until they meet the expected high standards.','Magoosh\r'),(527,0,'adjective','plentiful; pouring out in abundance.','During mile 20 of the Hawaii Marathon, Dwayne was sweating so profusely that he stopped to take off his shirt, and ran the remaining six miles wearing nothing more than skimpy shorts. Note:.','Magoosh\r'),(528,0,'noun','the property of being extremely abundant.','When Maria reported that she had been visited by Jesus Christ and had proof, a profusion of reporters. and journalists descended on the town.','Magoosh\r'),(529,0,'noun','a person who pleads for a cause or propounds an idea.','Ironically, the leading proponent of Flat-Earth Theory flies all over the world in an effort to win more adherents.','Magoosh\r'),(530,0,'adjective','under terms not final or fully worked out or agreed upon.','Until the corporate office hands down a definitive decision on use of the extra offices, we will share their use in a provisional arrangement.','Magoosh\r'),(531,0,'adjective','eager to fight or argue; verbally combative.','The comedian told one flat joke after another, and when the audience started booing, he pugnaciously back at them, \"Hey, you think this is easy -- why don\"t you buffoons give it a shot?\".','Magoosh\r'),(532,0,'noun','uneasiness about the fitness of an action.','While he could articulate no clear reason why Harkner\'s plan would fail, he neverless felt qualms about committing any resources to it.','Magoosh\r'),(533,0,'noun','state of uncertainty or perplexity especially as requiring a choice between equally unfavorable options.','Steve certainly is in a quandary: if he doesn\'t call Elaine, she will blame him for everything, but if he does call her, the evidence of where he currently is could cost him his job.','Magoosh\r'),(534,0,'noun','a witty saying or remark.','In one of the most famous quips about classical music, Mark Twain said: \"Wagner\'s music is better than it sounds.\".','Magoosh\r'),(535,0,'adjective','marked by a carefree unconventionality or disreputableness.','The men found him raffish, but the women adored his smart clothes and casual attitude.','Magoosh\r'),(536,0,'noun','a large number of something.','Despite a raft of city ordinances passed by an overzealous council, noise pollution continued unabated in the megalopolis. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(537,0,'adjective','marked by a carefree unconventionality or disreputableness.','As soon as he arrived in the city, the rakish young man bought some drugs and headed straight for the seedy parts of town.','Magoosh\r'),(538,0,'verb','gnaw into; make resentful or angry.','His constant whistling would rankle her, sometimes causing her to leave in a huff.','Magoosh\r'),(539,0,'adjective','marked by defiant disregard for danger or consequences; imprudently incurring risk Although Bruce was able to make the delivery in time with a nightime motorcycle ride in the rain, Susan.','criticized his actions as rash. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(540,0,'noun','an act of making something right.','Barry forgot his wife\'s birthday two years in a row, and was only able to redress his oversight by surprising his wife with a trip to Tahiti. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(541,0,'verb','assign to a lower position.','When Dexter was unable to fulfill his basic duties, instead of firing him, the boss relegated him to kitchen cleanup.','Magoosh\r'),(542,0,'adjective','to be negligent in one\"s duty.','Remiss in his duty to keep the school functioning efficiently, the principle was relieved of his position after only three months.','Magoosh\r'),(543,0,'verb','fail to fulfill a promise or obligation.','We will no longer work with that vendor since it has reneged on nearly every agreement.','Magoosh\r'),(544,0,'adjective','completely stocked or furnished with something.','Only weeks after the hurricane made landfall, the local supermarket shelves were replete with goods, so quick was the disaster relief response.','Magoosh\r'),(545,0,'noun','a person who is disapproved of.','Those old reprobates drinking all day down by the river--they are not going to amount to much.','Magoosh\r'),(546,0,'noun','an unstated doubt that prevents you from accepting something wholeheartedly.','I was initially excited by the idea of a trip to Washington, D.C. but now that I have read about the high crime statistics there, I have some reservations. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(547,0,'noun','the acceptance of something unpleasant that can\'t be avoided.','Since Jack could not think of a convincing reason why he had to miss the seminar, he attended it with a sense of resignation. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(548,0,'verb','reach a conclusion after a discussion or deliberation.','After much thought, Ted resolved not to travel abroad this summer because he didn\'t have much money in his bank account. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(549,0,'noun','a pause from doing something (as work).','Every afternoon, the small company has a respite in which workers play foosball or board games.','Magoosh\r'),(550,0,'adjective','to be shy, and to be inclined to retract from company.','Nelson was always the first to leave soirees--rather than mill about with \"fashionable\" folk, he was retiring, and preferred the solitude of his garret.','Magoosh\r'),(551,0,'verb','pull inward or towards a center; formally reject or disavow a formerly held belief, usually under pressure.','Email is wonderfully efficient, but once something awkward or damaging has been sent, there is no way to retract it.','Magoosh\r'),(552,0,'verb','cause annoyance in; disturb, especially by minor irritations.','Dan is usually calm and balanced, but it takes only one intense glare from Sabrina to rile him.','Magoosh\r'),(553,0,'adjective','sturdy and strong in form, constitution, or construction.','Chris preferred bland and mild beers, but Bhavin preferred a beer with more robust flavor.','Magoosh\r'),(554,0,'adjective','making a show of being pious; holier-than-thou.','Even during the quiet sanctity of evening prayer, she held her chin high, a sanctimonious sneer forming on her face as she eyed those who were attending church for the first time.','Magoosh\r'),(555,0,'adjective','cheerful; optimistic.','With the prospect of having to learn 3,000 words during the course of the summer, Paul was anything but sanguine.','Magoosh\r'),(556,0,'noun','a perceptive understanding.','Although a great CEO, he did not have the political savvy to win the election.','Magoosh\r'),(556,0,'verb','get the meaning of something.','The student savvies the meaning of astrophysics with little effort.','Magoosh\r'),(556,0,'adjective','well-informed or perceptive.','With his savvy business partner, the company was able to turn a profit within a year.','Magoosh\r'),(557,0,'adjective','describes someone who is brilliant and lively.','Richard Feynman was renowned for his scintillating lectures--the arcana of quantum physics was made lucid as he wrote animatedly on the chalkboard.','Magoosh\r'),(558,0,'noun','an abusive rant (often tedious).','Joey had difficulty hanging out with his former best friend Perry, who, during his entire cup of coffee, enumerated all of the government\'s deficiencies--only to break ranks and launch into some screed against big business.','Magoosh\r'),(559,0,'adjective','effusively or insincerely emotional, especially in art, music, and literature.','I don\'t like romanticism for the same reason I don\'t like melodramatic acting and soap operas--overly sentimental.','Magoosh\r'),(560,0,'noun','the instance in which an accidental, fortunate discovery is made.','The invention of the 3M Post It Note was serendipitous, because the scientist who had come up with the. idea was looking for a strong adhesive; the weak adhesive he came up with was perfect for holding a piece of paper in place but made it very easy for so.','Magoosh\r'),(561,0,'adjective','calm and peaceful.','I\'d never seen him so serene; usually, he was a knot of stress and anxiety from hours of trading on the stock exchange.','Magoosh\r'),(562,0,'adjective','carelessly and hastily put together.','The office building had been constructed in a slapdash manner, so it did not surprise officials when, during a small earthquake, a large crack emerged on the faade of the building.','Magoosh\r'),(563,0,'noun','a slight or superficial understanding of a subject; a small amount of something.','I know only a smattering of German, but Helen is able to read German newspapers and converse with natives.','Magoosh\r'),(564,0,'adjective','marked by excessive complacency or self-satisfaction.','When Phil was dating the model, he had a smug attitude that annoyed his buddies.','Magoosh\r'),(565,0,'adjective','expressive of contempt; derogatory or mocking in an indirect way.','The chairman interpreted Taylor\'s question about promotions as a snide remark, but in all innocence Taylor was trying to figure out the company\'s process.','Magoosh\r'),(566,0,'verb','refuse to acknowledge; reject outright and bluntly.','Wheeler was completely qualified for the committee, but the board snubbed him, choosing an obviously lesser qualified candidate instead.','Magoosh\r'),(567,0,'adjective','involving ignoble actions and motives; arousing moral distaste and contempt; foul and run-down and repulsive.','The nightly news simply announced that the senator had had an affair, but the tabloid published all the sordid details of the interaction. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(568,0,'noun','one who spends money extravagantly.','Taking weekly trips to Vegas, Megan was a spendthrift whose excesses eventually caught up to her.','Magoosh\r'),(569,0,'verb','reject with contempt.','She spurned all his flattery and proposals, and so he walked off embarrassed and sad.','Magoosh\r'),(570,0,'verb','spend thoughtlessly; waste time, money, or an opportunity.','Fearing his money would be squandered by his family, he gave all of it to charity when he died.','Magoosh\r'),(571,0,'adjective','characterized by dignity and propriety.','Frank came from a staid enviroment, so he was shocked that his college rooommate sold narcotics.','Magoosh\r'),(572,0,'verb','to suddenly move in a particular direction.','All alone in the mansion, Henrietta started when she heard a sound. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(573,0,'adjective','marked by firm determination or resolution; not shakable.','A good captain needs to be steadfast, continuing to hold the wheel and stay the course even during the most violent storm.','Magoosh\r'),(574,0,'verb','to hold back or limit the flow or growth of something.','To stem the tide of applications, the prestigious Ivy requires that each applicant score at least 330 on the Revised GRE. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(575,0,'noun','a regular allowance (of money).','He was hoping for a monthly allowance loan from the government, but after no such stipend was forthcoming he realized he would have to seek other means of paying for his college tuition.','Magoosh\r'),(576,0,'verb','hinder or prevent the progress or accomplishment of.','The engineers found their plans stymied at every turn and were ultimately able to make amlost no progress on the project.','Magoosh\r'),(577,0,'noun','the peak or highest point.','After hiking for two days, the climbers finally reached the summit of Mount Kilimanjaro.','Magoosh\r'),(577,0,'noun','a meeting of high-level leaders.','Since climate change policy has been mired in congressional fighting, this summit should help set the goals for president\'s next term.','Magoosh\r'),(578,0,'adjective','inclined to anger or bad feelings with overtones of menace.','Every morning, Bhavin was a surly unhappy person, but once he ate breakfast, he became loving, laughing, and a joy to be around.','Magoosh\r'),(579,0,'noun','consideration in dealing with others and avoiding giving offense.','In a tremendous display of tact, Shelly was able to maintain a strong friendship with Marcia, even though Marcia\'s husband, Frank, confessed to finding Shelley more attractive than Marcia.','Magoosh\r'),(580,0,'verb','make dirty or spotty, as by exposure to air; also used metaphorically.','Pete Rose was one of the best baseball players of his generation, but his involvement with gambling on baseball games has tarnished his image in the eyes of many.','Magoosh\r'),(581,0,'adjective','tastelessly showy; cheap and shoddy.','Carol expected to find New York City magical, the way so many movies had portrayed it, but she was. surprised how often tawdry displays took the place of genuine elegance.','Magoosh\r'),(582,0,'adjective','use to the limit; exhaust.','The hike to the summit of Mt. Whitney was so taxing that I could barely speak or stand up. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(583,0,'adjective','significant and revealing of another factor.','Her unbecoming dress was very telling when it came to her sense of fashion.','Magoosh\r'),(584,0,'adjective','revealing.','The many telltale signs of chronic smoking include yellow teeth, and a persistent, hacking cough.','Magoosh\r'),(585,0,'verb','offer up something formally.','The government was loath to tender more money in the fear that it might set off inflation. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(586,0,'adjective','very thorough; complete.','As a thoroughgoing bibliophile, one who had turned his house into a veritable library, he shocked his friends when he bought a Kindle.','Magoosh\r'),(587,0,'adjective','spending money wisely.','He was economical, spending his money thriftily and on items considered essential.','Magoosh\r'),(588,0,'verb','hinder or prevent (the efforts, plans, or desires) of.','I wanted to spend a week in New York this autumn, but the high costs of travel and lodging thwarted my plans.','Magoosh\r'),(589,0,'noun','an angry speech.','In terms of political change, a tirade oftentimes does little more than make the person speaking red in the face.','Magoosh\r'),(590,0,'verb','advertize in strongly positive terms; show off.','At the conference, the CEO touted the extraordinary success of his company\'s Research & Development division.','Magoosh\r'),(591,0,'adjective','lasting a very short time.','If we lived forever and life was not transitory, do you think we would appreciate life less or more?.','Magoosh\r'),(592,0,'noun','use of physical or mental energy; hard work; agony or anguish.','While they experienced nothing but travails in refinishing the kitchen, they completed the master bedroom in less than a weekend.','Magoosh\r'),(593,0,'noun','something, especially an event, that causes difficulty and suffering.','As of 2013, nearly 1.5 million Syrians have fled their country hoping to escape the tribulations of a civil war tearing their country to pieces.','Magoosh\r'),(594,0,'noun','a state of chaos, noise and confusion.','Riots broke out just in front of our apartment building, and the tumult continued late into the night.','Magoosh\r'),(595,0,'adjective','suggesting the operation of supernatural influences; surpassing the ordinary or normal.','Reggie has an uncanny ability to connect with animals: feral cats will readily approach him, and sometimes even wild birds will land on his finger.','Magoosh\r'),(596,0,'adjective','not making concessions.','The relationship between Bart and Hilda ultimately failed because they were both so uncompromising, never wanting to change their opinions.','Magoosh\r'),(597,0,'adjective','unreasonable; unscrupulous; excessive.','The lawyer\'s demands were so unconscionable that rather than pay an exorbitant sum or submit himself to any other inconveniences, the defendant decided to find a new lawyer.','Magoosh\r'),(598,0,'verb','to support financially.','The latest symphony broadcast was made possible with underwriting from the Carnegie Endowment.','Magoosh\r'),(599,0,'verb','to make nervous or upset.','At one time unnerved by math problems, she began avidly \"Magoosh-ing\", and soon became adept at even combinations and permutations questions.','Magoosh\r'),(600,0,'adjective','having never been done or known before; novel.','When America first created its national parks, the idea of setting aside the most beautiful land in a country was unprecedented in the history of mankind.','Magoosh\r'),(601,0,'adjective','(of persons) noisy and lacking in restraint or discipline; unwilling to submit to authority.','Walk in to any preschool and I am sure that you will find an unruly and chaotic scene--unless it\'s nap time.','Magoosh\r'),(602,0,'adjective','showing a high degree of refinement and the assurance that comes from wide social experience.','Because of his service as an intelligence officer and his refined tastes, W. Somerset Maugham became the inspiration for the urbane and sophistcate spy James Bond.','Magoosh\r'),(603,0,'adjective','devoid of intelligence, matter, or significance.','To the journalist\'s pointed question, the senator gave a vacuous response, mixing a few of his overall. campaign slogans with platitudes and completely avoiding the controversial subject of the question.','Magoosh\r'),(604,0,'verb','come out better in a competition, race, or conflict.','For years, Argentina would dominate in World Cup qualifying matches, only to be vanquished by one of the European countries during the late stages of the tournament.','Magoosh\r'),(605,0,'noun','the quality of varying.','The cynic quipped, \"There is not much variance in politicians; they all seem to prevaricate\".','Magoosh\r'),(606,0,'adjective','felt or undergone as if one were taking part in the experience or feelings of another.','The advent of twitter is a celebrity stalker\'s dream, as he or she can--through hundreds of intimate \"tweets\"--vicariously live the life of a famous person.','Magoosh\r'),(607,0,'verb','compete for something.','While the other teams in the division actively vie for the championship, this team seems content simply to go through the motions of playing.','Magoosh\r'),(608,0,'adjective','to have a very strong desire for revenge.','Though the other girl had only lightly poked fun of Vanessa\'s choice in attire, Vanessa was so vindictive that she waited for an entire semester to get the perfect revenge.','Magoosh\r'),(609,0,'noun','an ill-tempered or violent woman.','Poor Billy was the victim of the virago\'s invective--she railed at him for a good 30-minutes about how he is the scum of the earth for speaking loudly on his cellphone in public.','Magoosh\r'),(610,0,'adjective','very hungry; approaching an activity with gusto.','Steven was a voracious reader, sometimes finishing two novels in the same day.','Magoosh\r'),(611,0,'adjective','without check or limitation; showing no moral restraints to one\'s anger, desire, or appetites.','Due to wanton behavior and crude language, the drunk man was thrown out of the bar and asked to never return.','Magoosh\r'),(612,0,'verb','to gradually increase in size or intensity.','Her enthusiasm for the diva\'s new album only waxed with each song; by the end of the album, it was her favorite CD yet. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(613,0,'adjective','determined by impulse or whim rather than by necessity or reason.','Adults look to kids and envy their whimsical nature at times, wishing that they could act without reason and play without limitation.','Magoosh\r'),(614,0,'noun','the highest point; culmination.','At the zenith of his artistic career, Elvis was outselling any other artist on the charts. Advanced Words.','Magoosh\r'),(615,0,'verb','formally reject or give up (as a belief).','While the church believed that Galileo abjured the heliocentric theory under threat of torture, he later wrote a book clearly supporting the theory.','Magoosh\r'),(616,0,'verb','revoke formally.','As part of the agreement between the labor union and the company, the workers abrogated their right to strike for four years in exchange for better health insurance.','Magoosh\r'),(617,0,'verb','to serve as a judge in a competition; to arrive at a judgment or conclusion.','Only those with the most refined palates were able to adjudicate during the barbeque competition.','Magoosh\r'),(618,0,'verb','provide with an opportunity.','The summit of Mt. Kilimanjaro affords a panoramic view that encompasses both Tanzania and Kenya. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(619,0,'noun','an eager willingness to do something.','The first three weeks at his new job, Mark worked with such alacrity that upper management knew it would be giving him a promotion.','Magoosh\r'),(620,0,'noun','something that is inappropriate for the given time period (usually something old).','Dressed in 15th century clothing each day, Edward was a walking anachronism.','Magoosh\r'),(621,0,'noun','a detested person; the source of somebody\'s hate.','Hundreds of years ago, Galileo was anathema to the church; today the church is anathema to some on the left side of the political spectrum.','Magoosh\r'),(622,0,'adjective','lacking energy and vigor.','After three straight shows, the lead actress gave an anemic performance the fourth night, barely speaking loudly enough for those in the back rows to hear.','Magoosh\r'),(623,0,'noun','something that soothes or relieves pain.','Muzak, which is played in department stores, is intended to be an anodyne, but is often so cheesy and over-the-top that customers become irritated.','Magoosh\r'),(623,0,'adjective','inoffensive.','Wilbur enjoyed a spicy Mexican breakfast, but Jill prefered a far more anodyne meal in the mornings.','Magoosh\r'),(624,0,'adjective','ludicrously odd.','The clown\'s antic act was too extreme for the youngest children, who left the room in tears. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(625,0,'noun','great coolness and composure under strain.','Nancy acted with aplomb during dangerous situations--she once calmly climbed up an oak tree to save a. cat.','Magoosh\r'),(626,0,'noun','the highest point.','The apogee of the Viennese style of music, Mozart\'s music continues to mesmerize audiences well into the 21st century.','Magoosh\r'),(627,0,'noun','a person who has abandoned a religious faith or cause.','An apostate of the Republican Party, Sheldon has yet to become affiliated with any party and dubs himself an independent.','Magoosh\r'),(628,0,'noun','a short, pithy instructive saying.','Winston Churchill is famous for many apothegms, but this might be his most famous: \"It has been said that democracy is the worst form of government except all the others that have been tried.\".','Magoosh\r'),(629,0,'noun','exaltation to divine status; the highest point of development.','As difficult as it is to imagine, the apotheosis of Mark Zuckerberg\'s career, many believe, is yet to come.','Magoosh\r'),(630,0,'adjective','expressing praise or approval.','Although it might not be her best work, Hunter\'s new novel has received generally approbatory reviews.','Magoosh\r'),(631,0,'verb','to give or take something by force.','The government appropriated land that was occupied by squatters, sending them scurrying for another place to live. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(631,0,'verb','to allocate.','The committe appropriated the funds to its various members. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(632,0,'adjective','supply added support.','In hiking Mt. Everest, sherpas are appurtenant, helping climbers both carry gear and navigate treacherous paths.','Magoosh\r'),(633,0,'adjective','to be deliberately teasing.','The baroness was arch, making playful asides to the townspeople; yet because they couldn\'t pick up on her dry humor, they thought her supercilious. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(634,0,'adjective','complete and wholly (usually modifying a noun with negative connotation).','An arrant fool, Lawrence surprised nobody when he lost all his money in a pyramid scheme that was every bit as transparent as it was corrupt.','Magoosh\r'),(635,0,'noun','a person who has recently reached a position of power; a social climber.','The city center was aflutter with arrivistes who each tried to outdo one another with their ostentatious sports cars and chic evening dress.','Magoosh\r'),(636,0,'verb','seize and control without authority.','Arriving at the small town, the outlaw arrogated the privileges of a lord, asking the frightened citizens to provide food, drink, and entertainment.','Magoosh\r'),(637,0,'noun','cunning tricks used to deceive others.','The mayoral candidates both spent much of the campaign accusing each other of artifices designed to mislead the voting public.','Magoosh\r'),(638,0,'adjective','without cunning or deceit.','Despite the president\'s seemingly artless speeches, he was a skilled and ruthless negotiator.','Magoosh\r'),(639,0,'noun','the quality of innocence.','I, personally, found the artlessness of her speech charming.','Magoosh\r'),(640,0,'noun','harshness of manner.','The editor was known for his asperity, often sending severe letters of rejection to amateur writers.','Magoosh\r'),(641,0,'adverb','with care and persistence.','The top college football program recruits new talent assiduously, only choosing those who were the top in their county.','Magoosh\r'),(642,0,'noun','a reappearance of an earlier characteristic; throwback.','Much of the modern art movement was an atavism to a style of art found only in small villages through Africa and South America.','Magoosh\r'),(643,0,'verb','to weaken (in terms of intensity); to taper off/become thinner.','Her animosity towards Bob attenuated over the years, and she even went so far as to invite him to her party.','Magoosh\r'),(644,0,'adjective','offensively self-assured or given to exercising usually unwarranted power.','The manager was finally fired for his autocratic leadership, which often bordered on rude and offensive.','Magoosh\r'),(645,0,'adjective','threatening or foreshadowing evil or tragic developments.','Movies often use storms or rain clouds as a baleful omen of evil events that will soon befall the main character.','Magoosh\r'),(646,0,'adjective','the lowest, class were without any moral principles.','She was not so base as to begrudge the beggar the unwanted crumbs from her dinner plate. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(647,0,'noun','an act that debases or corrupts.','The movie World War Z is a complete bastardization of the book with little more in common than zombies and a title.','Magoosh\r'),(648,0,'verb','to evade or dodge (a question).','By assuming that Charlie was headed to college--which he was not--Maggie begged the question when she asked him to which school he was headed in the Fall. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(649,0,'verb','express discontent or a stong regret.','While the CFO carefully explained all the reasons for the cuts in benefits, after the meeting employees bemoaned the cuts as further evidence that management was against them.','Magoosh\r'),(650,0,'adjective','fallen into a state of ignorance.','Far from being a period of utter benightedness, The Medieval Ages produced some great works of theological speculation.','Magoosh\r'),(651,0,'adjective','unhappy in love; suffering from unrequited love.','After 64 years of marriage, William was bereft after the death of his wife.','Magoosh\r'),(651,0,'adjective','sorrowful through loss or deprivation.','You are not bereft if you haven\'t played on your Xbox in the past week, his mother said.','Magoosh\r'),(652,0,'adjective','strongly affectionate towards.','Even though her father did not approve, Juliet became besotted with the young Romeo.','Magoosh\r'),(652,0,'adjective','very drunk.','Never before have I seen my mom so besotted, and honestly, I hope it\'s the last time she drinks so much.','Magoosh\r'),(653,0,'adjective','irritable; always angry.','Rex was bilious all morning, and his face would only take on a look of contentedness when he\'d had his morning cup of coffee.','Magoosh\r'),(654,0,'adjective','to have a limited outlook or understanding.','In gambling, the addict is easily blinkered by past successes and/or past failures, forgetting that the outcome of any one game is independent of the games that preceded it.','Magoosh\r'),(655,0,'verb','edit by omitting or modifying parts considered indelicate.','To recieve an R rating, the entire movie was bowdlerized because it contained so much violence and grotesque subject matter.','Magoosh\r'),(656,0,'verb','anger or take offense.','The hostess bridled at the tactless dinner guests who insisted on eating before everybody had gotten their food.','Magoosh\r'),(657,0,'verb','react in an offended or angry manner.','As we discussed the painting, I noticed the artitst\'s wife bristling at our criticisms, ready to defend her husband\'s work.','Magoosh\r'),(658,0,'noun','a strong verbal attack.','Political broadsides are usually strongest in the weeks leading up to a national election.','Magoosh\r'),(659,0,'noun','a trite or obvious remark.','Instead of sharing his umbrella, the cheeky stranger offered Martha the following bromide: \"Looks like it\'s raining.\".','Magoosh\r'),(660,0,'verb','put up with something or somebody unpleasant.','While she was at the chalkboard, the teacher did not brook any form of talking--even a tiny peep resulted in afternoon detention. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(661,0,'adjective','intricate and complex.','Getting a driver\'s license is not simply a matter of taking a test; the regulations and procedures are so byzantine that many have found themselves at the mercy of the Department of Motor Vehicles.','Magoosh\r'),(662,0,'adjective','young and inexperienced.','Both Los Angeles and New York are known for callow out-of-towners hoping to make it big.','Magoosh\r'),(663,0,'noun','to surrender (usually under agreed conditions).','Paul, losing 19-0 in a ping-pong match against his nimble friend, basically capitulated when he played the last two points with his eyes closed.','Magoosh\r'),(664,0,'noun','an event resulting in great loss and misfortune.','The introduction of smallpox was a cataclysm for Native Americans, killing off more than half of their population.','Magoosh\r'),(665,0,'adjective','of broad scope; universal.','Jonah\'s friends said that Jonah\'s taste in music was eclectic; Jonah was quick to point out that not only was his taste eclectic but it was also catholic: he enjoyed music from countries as far-flung as Mali and. Mongolia.','Magoosh\r'),(666,0,'verb','relinquish possession or control over.','Eventually, all parents must cede control of their growing childrens\' educations and allow their offspring some autonomy.','Magoosh\r'),(667,0,'noun','speed, rapidity.','We aim to respond to customers\' questions with celerity and accuracy, with no longer than a 24 hour wait time.','Magoosh\r'),(668,0,'noun','strong feelings of embarrassment.','Much to the the timid writer\'s chagrin, the audience chanted his name until he came back on the stage.','Magoosh\r'),(668,0,'verb','cause to feel shame; hurt the pride of.','She never cared what others said about her appearance but was chagrined by the smallest comment from her mother.','Magoosh\r'),(669,0,'noun','a flamboyant deceiver; one who attracts customers with tricks or jokes.','You may call him a \"motivational speaker,\" but I call him a charlatan--he doesn\'t have any idea what he\'s really talking about.','Magoosh\r'),(670,0,'adjective','cautious.','Jack was wary of GRE words that looked similar, because they usually had different definitions; not so with chary, a word that he began to use interchangeably with wary.','Magoosh\r'),(671,0,'noun','fanatical patriotism; belief that one\'s group/cause is superior to all other groups/causes.','Vegetarians argue that man is chauvinistic in his belief that animals do not consciously feel the pain we humans do. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(672,0,'noun','something desired or wished for but is only an illusion and impossible to achieve Many believe that a world free of war is a chimera--a dream that ignores humanity\'s violent tendancies.','This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(673,0,'adjective','prone to outbursts of temper; easily angered.','While a brilliant lecturer, Mr. Dawson came across as choleric and unapproachable--very rarely did students come to his office hours.','Magoosh\r'),(674,0,'adjective','lacking manners or refinement.','The manager was unnecessarily churlish to his subordinates, rarely deigning to say hello, but always quick with a sartorial jab if someone happened to be wearing anything even slightly mismatching.','Magoosh\r'),(675,0,'adjective','showing a cheerful willingness to do favors for others.','On her first day at the job, Annie was complaisant, fulfilling every request of her new employee and. anticipating future requests.','Magoosh\r'),(676,0,'adjective','Associated with or participating in an activity, especially one of a questionable nature.','While the grand jury cleared the senator of all criminal charges, in the public mind he was still complicit in the corruption.','Magoosh\r'),(677,0,'verb','to make peace with.','His opponents believed his gesture to be conciliatory, yet as soon as they put down their weapons, he unsheathed a hidden sword.','Magoosh\r'),(678,0,'adjective','describing an event or situation that happens at the same time as or in connection with another.','Concomitant with his desire for nature was a desire for the culture and energy of a big city.','Magoosh\r'),(679,0,'noun','a very intense and uncontrolled fire.','In the summer months, conflagrations are not uncommon in the southwest, do to the heat and lack of rain.','Magoosh\r'),(680,0,'verb','mix together different elements or concepts.','In her recent book, the author conflates several genres--the detective story, the teen thriller, and the vampire romance--to create a memorable read.','Magoosh\r'),(681,0,'adjective','likely to argue.','Since old grandpa Harry became very contentious during the summer when only reruns were on T.V., the grandkids learned to hide from him at every opportunity.','Magoosh\r'),(682,0,'noun','a practical consequence that follows naturally.','A corollary of Hurricane Sandy, which ravaged the east coast of the U.S., is a push to build higher sea walls to protect against future hurricanes.','Magoosh\r'),(683,0,'verb','treat with excessive indulgence.','The king and queen cosseted the young prince, giving him a prized miniature pony for his fifth birthday.','Magoosh\r'),(684,0,'adjective','being of equal extent or scope or duration.','The border of the state is coterminous with geographic limits on travel; the east and north are surrounded by a nearly uncrossable river and the south by a desert.','Magoosh\r'),(685,0,'verb','a contrary command cancelling or reversing a previous command.','By the time the colonel countermanded his soldiers not to land in enemy territory, a few helicopters had already touched down amid heavy gunfire.','Magoosh\r'),(686,0,'verb','to intimidate.','Do not be cowed by a 3,000-word vocabulary list: turn that list into a deck of flashcards!. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(687,0,'adjective','brought low in spirit.','I asked Maria on a date and she refused without a moment\'s thought; I was crestfallen.','Magoosh\r'),(688,0,'verb','cause to take on a definite and clear shape.','Only after fifteen minutes of brainstorming did Samantha\'s ideas for the essay crystallize. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(689,0,'noun','greed for money.','Some believe people that amassing as much wealth as possible is the meaning to life--yet they often realize that cupidity brings anything but happiness.','Magoosh\r'),(690,0,'noun','a grouchy, surly person.','Since Uncle Mike was the family curmudgeon, each Thanksgiving he was plied with copious amounts of wine, in the hope that she would become less grouchy.','Magoosh\r'),(691,0,'adjective','having a sophisticated charm.','James Bond is known for his good looks, high tech gadgets, and debonair manner.','Magoosh\r'),(692,0,'verb','express strong disapproval of.','The entire audience erupted in shouts and curses, decrying the penalty card issued by the referee.','Magoosh\r'),(693,0,'verb','to help pay the cost of, either in part of full.','In order for Sean to attend the prestigious college, his generous uncle helped defray the excessive tuition with a monthly donation.','Magoosh\r'),(694,0,'verb','do something that one considers to be below one\'s dignity.','The master of the house never deigned to answer questions from the servants.','Magoosh\r'),(695,0,'adjective','given to or marked by the open expression of emotion.','When Sally told James that she wanted to break up with him, she expected he would react demonstratively, but he quietly nodded his head and left without saying a word.','Magoosh\r'),(696,0,'noun','the final resolution of the many strands of a literary or dramatic work; the outcome of a complex sequence of events.','At the denouement of the movie, all questions were answered, and the true identity of the robber was revealed.','Magoosh\r'),(697,0,'adjective','(of a person) not doing one\'s duties.','The teacher was derelict in her duties because she hadn\'t graded a single student paper in three weeks.','Magoosh\r'),(697,0,'noun','(of a building) abandoned.','At one time the waterfront factories were busy and productive, but now they stand derelict and will be. torn down.','Magoosh\r'),(698,0,'adjective','uninteresting, lacking vitality.','Few novelists over 80 are able to produce anything more than desiccated works--boring shadows of former books. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(699,0,'noun','something desired as a necessity.','The desideratum of the environmental group is that motorists should rely on carpooling.','Magoosh\r'),(700,0,'noun','a cruel and oppressive dictator.','The Emperor Claudius was regarded as a fair-minded leader; his successor, Nero, was an absolute despot.','Magoosh\r'),(701,0,'noun','a strong verbal attack against a person or institution.','Steve\'s mom launched into a diatribe during the PTA meeting, contending that the school was little more than a daycare in which students stare at the wall and teachers stare at the chalkboard.','Magoosh\r'),(702,0,'noun','to indicate smallness.','He prefers to be called a diminutive of his name: \"Bill\" instead of \"John William.\".','Magoosh\r'),(702,0,'adjective','very small.','When he put on his father\'s suit and shoes, his appearance was that of a diminutive youth.','Magoosh\r'),(703,0,'verb','to persuade somebody that his/her belief is not valid.','As a child, I was quickly disabused of the notion that Santa Claus was a rotund benefactor of infinite largess--one night I saw my mother diligently wrapping presents and storing them under our Christmas tree.','Magoosh\r'),(704,0,'adjective','(of e.','g. speech and writing) tending to depart from the main point. Many readers find it tough to read Moby Dick since the author is discursive, often cutting the action short to spend 20 pages on the history of a whale.','Magoosh\r'),(705,0,'adjective','not straightforward; giving a false appearance of frankness.','Many adults think that they can lie to children, but kids are smart and know when people are disingenuous.','Magoosh\r'),(706,0,'noun','an exemption from a rule or obligation.','Since her father is a billionaire, she is given dispensation from many of the school\'s policies. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(707,0,'verb','conceal one\'s true motives, usually through deceit.','To get close to the senator, the assassin dissembled his intentions, convincing many people that he was a reporter for a well-known newspaper.','Magoosh\r'),(708,0,'verb','squander or spend money frivolously.','The recent graduates dissipated their earnings on trips to Las Vegas and cruises in Mexico.','Magoosh\r'),(708,0,'verb','to disperse or scatter.','Kathleen\'s perfume was overwhelming in the cramped apartment, but once we stepped outside the smell dissipated and we could breathe once again.','Magoosh\r'),(709,0,'noun','a living full of debauchery and indulgence in sensual pleasure.','Many Roman emporers were known for their dissolution, indulging in unspeakable desires of the flesh. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(710,0,'adjective','filled with or evoking sadness.','No event is more doleful than the passing of my mother; she was a shining star in my life, and it brings me great sadness to think that she is now gone.','Magoosh\r'),(711,0,'adjective','showing sorrow.','Chopin\'s ballades are filled with sharp changes in moods--a dolorous melody can give way to a lighthearted tempo.','Magoosh\r'),(712,0,'adjective','brave; bold; courageous.','I enjoy films in which a doughty group comes together to battle a force of evil.','Magoosh\r'),(713,0,'verb','fit together tightly, as if by means of a interlocking joint.','Although Darwin\'s evolution and Mendel\'s genetics were developed in isolation from one another, they dovetail each other very well. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(714,0,'noun','deceitfulness, pretending to want one thing but interested in something else.','A life of espionage is one of duplicity: an agent must pretend to be a totally different person than who she or he actually is.','Magoosh\r'),(715,0,'adjective','joyously unrestrained.','Can you blame him for his ebullient mood? He just graduated from medical school.','Magoosh\r'),(716,0,'adjective','marked by high spirits or excitement.','After the sales result, the manager was in an effervescent mood, letting several employees leave work early that day. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(717,0,'noun','audacious (even arrogant) behavior that you have no right to.','The skateboarders acted with effrontery, skating through the church grounds and spray-painting signs warning trespassers.','Magoosh\r'),(718,0,'adjective','expressing sorrow.','Few can listen to the elegiac opening bars of the Moonlight sonata without feeling the urge to cry.','Magoosh\r'),(719,0,'adjective','in an early stage of development.','The Board of Directors is hoping to launch a new product soon, but planning for the Z7 is in an embryonic stages. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(720,0,'noun','any method that derives knowledge from experience, used in experimental science as a way to gain insight and knowledge.','Empiricism does not always lead to knowledge; an experience or experiment may raise more questions than it answers.','Magoosh\r'),(721,0,'verb','attraction or feeling of love.','She is completely enamored with Justin Bieber, and goes to all his concerts on the East coast.','Magoosh\r'),(722,0,'verb','hold back.','The costume encumbered all my movements and caused me to sweat profusely.','Magoosh\r'),(723,0,'verb','give instructions to or direct somebody to do something with authority.','The government agency enjoined the chemical company to clean up the hazardous dump it had created over the years.','Magoosh\r'),(724,0,'noun','an act of extreme wickedness.','The enormity of Pol Pot\'s regime is hard to capture in words--within months hundreds of thousands of Cambodians lost their lives. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(725,0,'verb','hold spellbound.','She was so enthralled by the movie that she never heard people screaming, \"Fire! Fire!\" in the neighboring theater.','Magoosh\r'),(726,0,'noun','a witty saying.','My favorite epigram from Mark Twain is \"A man who carries a cat by the tail learns something he can learn no other way.\".','Magoosh\r'),(727,0,'noun','a sudden revelation or moment of insight.','Gary one day had an epiphany that he was a people person; he prompty quit his factory job and began working as a salesman.','Magoosh\r'),(728,0,'noun','the name derived from a person (real or imaginary); the person for whom something is named.','Alexandria, Egypt is an eponym because it is named after Alexander the Great.','Magoosh\r'),(729,0,'adjective','fair to all parties as dictated by reason and conscience.','The equitable distribution of ice cream to a group of 5 year olds will ensure little to no fighting--at least until the ice cream is gone.','Magoosh\r'),(730,0,'verb','to speak vaguely, usually with the intention to mislead or deceive.','After Sharon brought the car home an hour after her curfew, she equivocated when her parents pointedly asked her where she had been.','Magoosh\r'),(731,0,'adjective','not real or genuine; phony.','The car dealer\'s ersatz laughter was immediately followed by a price quote, one that Shelley found highly inflated.','Magoosh\r'),(732,0,'adjective','deserving of esteem and respect.','After serving thirty years, in which he selflessly served the community, Judge Harper was one of the more estimable people in town.','Magoosh\r'),(733,0,'adjective','characterized by lightness and insubstantiality.','Because she dances with an ethereal style, ballet critics have called her Madame Butterfly.','Magoosh\r'),(734,0,'adjective','tending to vanish like vapor.','The storm flashed into existence above us and lasted only a short time--an evanescent turbulence of wind and cloud.','Magoosh\r'),(735,0,'verb','to criticize very harshly.','Entrusted with the prototype to his company\'s latest smartphone, Larry, during a late night karaoke bout, let the prototype slip into the hands of a rival company--the next day Larry was excoriated, and then fired.','Magoosh\r'),(736,0,'verb','to curse and hiss at.','Though the new sitcom did decently in the ratings, Nelson railed against the show, saying that it was nothing more than an execrable pastiche of tired clich\'s and canned laughter.','Magoosh\r'),(737,0,'noun','critical explanation or analysis, especially of a text.','The Bible is fertile ground for exegesis--over the past five centuries there have been as many interpretations as there are pages in the Old Testament.','Magoosh\r'),(738,0,'noun','something to be imitated.','Lena\'s homework is on the wall because it is an exemplar of clean, neat, and thoughtful work.','Magoosh\r'),(739,0,'noun','the quality of being meager.','After two months at sea, the exiguity of the ship\'s supplies forced them to search for fresh water and food.','Magoosh\r'),(740,0,'adjective','greatly exceeding bounds of reason or moderation.','Shelley made one exorbitant purchase after another, buying new clothes and taking vacations even though she earned a limited salary.','Magoosh\r'),(741,0,'adjective','communicative, and prone to talking in a sociable manner.','After a few sips of cognac, the octogenarian shed his irascible demeanor and became expansive, speaking fondly of the \"good old days\". This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(742,0,'verb','to eliminate completely.','When I turned 18, all of the shoplifting and jaywalking charges were expunged from my criminal record.','Magoosh\r'),(743,0,'verb','to remove objectionable material.','The censor expurgated every reference to sex and drugs, converting the rapper\'s raunchy flow into a series of bleeps.','Magoosh\r'),(744,0,'verb','draw from specific cases for more general cases.','By extrapolating from the data on the past three months, we can predict a 5% increase in traffic to our website.','Magoosh\r'),(745,0,'adjective','arrived at without due care or effort; lacking depth.','Many news shows provide facile explanations to complex politics, so I prefer to read the in-depth reporting of The New York Times.','Magoosh\r'),(746,0,'adjective','produced by, or characterized by internal dissension.','The controversial bill proved factious, as dissension even within parties resulted.','Magoosh\r'),(747,0,'adjective','artificial; not natural.','The defendant\'s story was largely factitious and did not accord with eyewitness testimonies.','Magoosh\r'),(748,0,'adjective','lazy and irresponsible.','Two years after graduation, Charlie still lived with his parents and had no job, becoming more feckless with each passing day.','Magoosh\r'),(749,0,'adjective','intellectually productive.','The artist had entered a fecund period, producing three masterpieces in the span of two months.','Magoosh\r'),(750,0,'adjective','terribly evil.','For fans of the Harry Potter series, the fell Lord Voldemort, who terrorized poor Harry for seven lengthy installments, has finally been vanquished by the forces of good--unless, that is, JK Rowling decides to come out of retirement. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(751,0,'noun','someone who deliberately creates trouble.','Freddie is a firebrand: every time he walks into the office, he winds up at the center of heated argument.','Magoosh\r'),(752,0,'verb','droop, sink, or settle from or as if from pressure or loss of tautness; become less intense After the three crushing defeats in the last three games, the team\'s enthusiasm began to flag.','This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(753,0,'adjective','showing inappropriate levity.','Although Sam was trying to honor Mark\'s sense of humor, many found it quite flippant that he wore a comic nose and glasses mask to Mark\'s funeral.','Magoosh\r'),(754,0,'verb','be a mystery or bewildering to.','Mary\'s behavoir completely flummoxes me: I never have any idea what her motivations might be.','Magoosh\r'),(755,0,'adjective','irritable and is likely to cause disruption.','We rarely invite my fractious Uncle over for dinner; he always complains about the food, and usually launches into a tirade on some touchy subject.','Magoosh\r'),(756,0,'noun','a socially awkward or tactless act.','In a famous gaffe, Vice President Quayle attempted to correct the spelling of a grade school student, only to find that the child was correct.','Magoosh\r'),(757,0,'noun','a manuveur or risk in a game or conversation, designed to secure an advantage.','Randy played a gambit, telling his boss that he would leave at the end of the week if he didn\'t get a raise.','Magoosh\r'),(758,0,'noun','corruption, usually through bribery.','In countries with rampant graft, getting a driver\'s license can require no more than paying an official. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(759,0,'adjective','puffed up with vanity.','The dictator was known for his grandiloquent speeches, puffing his chest out and using big, important- sounding words.','Magoosh\r'),(760,0,'noun','resourcefulness and determination.','Wallace Stegner lamented the lack of gumption in the U.S. during the sixties, claiming that no young person knew the value of work.','Magoosh\r'),(761,0,'adjective','excessively flattering toward someone\'s life or work.','Most accounts of Tiger Woods life were hagiographic, until, that is, his affairs made headlines.','Magoosh\r'),(762,0,'verb','enthusiastically acclaim or celebrate something.','Many college superstar athletes are hailed as the next big thing, but then flop at the professional level. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(763,0,'adjective','idyllically calm and peaceful; suggesting happy tranquillity; marked by peace and prosperity.','The first decade after WWI was a halcyon period in America with new-found wealth and rapidly improving technology.','Magoosh\r'),(764,0,'noun','overbearing pride evidenced by a superior manner toward inferiors.','As soon as she won the lottery, Alice begin displaying a hauteur to her friends, calling them dirty-clothed peasants behind their backs.','Magoosh\r'),(765,0,'verb','to bully or intimidate.','The boss\'s hectoring manner put off many employees, some of whom quit as soon as they found new jobs.','Magoosh\r'),(766,0,'verb','to limit or qualify a statement; to avoid making a direct statement.','When asked why he had decided to buy millions of shares at the very moment the tech companies stock soared, the CEO hedged, mentioning something vague about gut instinct. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(767,0,'adjective','to be overly theatrical.','Though she received a B- on the test, she had such a histrionic outburst that one would have thought that she\'d been handed a death sentence.','Magoosh\r'),(768,0,'adjective','ancient.','Most workout gurus are young, fit people, whereas most yoga gurus are hoary men with long white beards.','Magoosh\r'),(769,0,'verb','to hold back the progress of something.','Bad weather has hobbled rescue efforts, making it difficult for crews to find bodies in the wreckage.','Magoosh\r'),(770,0,'verb','to deceive or trick someone.','Someone tried to hoodwink Marty with an email telling him that his uncle had just passed away, and to collect the inheritance he should send his credit card information.','Magoosh\r'),(771,0,'noun','overbearing pride or presumption.','Bill Clinton was criticized for his hubris, since he believed he could get away with anything once in the White House.','Magoosh\r'),(772,0,'verb','to drink or absorb as if drinking.','Plato imbibed Socrates\' teachings to such an extent that he was able to write volumes of work that he directly attributed, sometimes word for word, to Socrates.','Magoosh\r'),(773,0,'noun','a confusing and potentially embarrassing situation.','The chef cook-off featured one gourmand who had the unfortunate distinction of mixing the wrong broths, creating an imbroglio that diners would not soon forget.','Magoosh\r'),(774,0,'verb','to enclose, usually in walls.','The modern supermarket experience makes many feel claustrophobic, as they are immured in walls upon walls of products.','Magoosh\r'),(775,0,'adjective','lacking money; poor.','In extremely trying times, even the moderately wealthy, after a few turns of ill-fortune, can become impecunious.','Magoosh\r'),(776,0,'adjective','having or showing arrogant superiority to and disdain of those one views as unworthy.','Children are imperious with each other before they learn that earning someone\'s respect is better than demanding.','Magoosh\r'),(777,0,'verb','beg persistently and urgently.','After weeks of importuning the star to meet for a five-minute interview, the journalist finally got what she wanted.','Magoosh\r'),(778,0,'adjective','not given careful consideration.','Marty was improvident, never putting money aside for the future but spending it on decorating the interior of his home.','Magoosh\r'),(779,0,'verb','attack as false or wrong.','Though many initially tried to impugn Darwin\'s theory, in scientific circles today, the is idea taken as truth.','Magoosh\r'),(780,0,'verb','attribute (responsibility or fault) to something.','He imputed his subpar performance on the test to a combination of stress and poor sleep.','Magoosh\r'),(781,0,'noun','total lack of meaning or ideas.','Bill\'s poem was nothing more than a list of impressive sounding words, so there was no point in trying to take meaning from the inanity.','Magoosh\r'),(782,0,'adjective','only partly in existence; imperfectly formed.','Inchoate ideas about the relation of humans to other animals had been discussed since the Middle Ages but the modern theory really began with Darwin.','Magoosh\r'),(783,0,'adjective','necessarily or demonstrably true; impossible to deny or disprove.','Unless you can provide incontrovertible evidence, I will remain skeptical.','Magoosh\r'),(784,0,'adjective','poor; having very little.','In the so-called Third World, many are indigent and only a privileged few have the resources to enjoy material luxuries.','Magoosh\r'),(784,0,'noun','a poor or needy person.','The indigents, huddled under the overpass, tried to start a small bonfire in the hope of staying warm.','Magoosh\r'),(785,0,'adjective','too sacred to be uttered; defying expression or description.','While art critics can occasionally pinpoint a work\'s greatness, much of why a piece captures our imaginations is completely ineffable.','Magoosh\r'),(786,0,'adjective','impossible to avoid or evade:.','For those who smoke cigarettes for years, a major health crisis brought on by smoking is ineluctable.','Magoosh\r'),(787,0,'noun','injustice by virtue of not conforming with rules or standards.','After decades of racial inequity, the \"separate but equal\" doctrine was successfully overturned.','Magoosh\r'),(788,0,'adjective','inappropriate.','During the executive meeting, the marketing director continued to make infelicitous comments about the CEO\'s gambling habit.','Magoosh\r'),(789,0,'adjective','defying imitation; matchless.','Mozart\'s music follows a clear pattern that, anyone could imitate, but his music gives an overall sense of effortlessness that is inimitable.','Magoosh\r'),(790,0,'noun','lack of concern.','Surprisingly, Hank had become a high-powered CEO; his high school friends remembered him as \"Hanky Panky\", who shrugged off each failed class with insouciance.','Magoosh\r'),(791,0,'adjective','intolerable, difficult to endure.','Chester always tried to find some area in which he excelled above others; unsurprisingly, his co-workers found him insufferable and chose to exclude him from daily luncheons out.','Magoosh\r'),(792,0,'adjective','(of conflict) within a group or organization.','The guerilla group, which had become so powerful as to own the state police, was finally destroyed by an internecine conflict.','Magoosh\r'),(793,0,'noun','an indirect suggestion.','At first the hostess tried intimation, praising the benefits of cutlery; when Cecil continued eating with his hands, the hostess told him to use a fork at dinner.','Magoosh\r'),(794,0,'verb','to make accustomed to something unpleasant.','Three years of Manhattan living has inured her to the sound of wailing sirens; she could probably sleep through the apocalypse.','Magoosh\r'),(795,0,'noun','abusive or denunciatory language.','The Internet has unleashed the invectives in many of us; many people post stinging criticism on the comments section underneath newspaper articles or YouTube videos.','Magoosh\r'),(796,0,'adjective','likely to cause resentment.','At a time when many others in the office were about to be laid off, many considered Cheryl\'s fine clothes that day an invidious display. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(797,0,'adjective','never to be broken, infringed, or dishonored.','Too many the grass at Wimbledon is inviolable and only greater tennis players are able to enjoy a game there.','Magoosh\r'),(798,0,'adjective','must be kept sacred.','While the literary critic subjected most of the classics to the harshest reviews, he regarded Cervantes as inviolate, and had nothing but praise for him.','Magoosh\r'),(799,0,'adjective','impossible to deny or disprove.','The existence of life on earth is irrefutable; the existence of intelligent life on earth is still hotly debated.','Magoosh\r'),(800,0,'adjective','to be biased against due to envy or prejudice.','Shelly was jaundiced towards Olivia; though the two had once been best friends, Olivia had become class president, prom queen, and, to make matters worse, the girlfriend of the one boy Shelly liked.','Magoosh\r'),(801,0,'adjective','dull; lacking flavor.','Although many top chefs have secured culinary foam\'s popularity in haute cuisine, Waters criticizes it for being jejune and unfilling.','Magoosh\r'),(801,0,'adjective','immature; childish.','Her boss further cemented his reuptation for being jejune after throwing a fit when the water cooler wasn\'t refilled.','Magoosh\r'),(802,0,'noun','a person who thinks that their country should be at war.','In the days leading up to war, a nation typically breaks up into the two opposing camps: doves, who do their best to avoid war, and jingoists, who are only too eager to wave national flags from their vehicles and vehemently denounce those who do not do th.','Magoosh\r'),(803,0,'noun','a force that cannot be stopped.','Napoleon was considered a juggernaut until he decided to invade Russia in winter; after which, his once indomitable army was decimated by cold and famine.','Magoosh\r'),(804,0,'verb','to bow or act in a subservient manner.','Paul kowtowed to his boss so often the boss herself became nauseated by his sycophancy.','Magoosh\r'),(805,0,'verb','deeply hurt the feelings of; distress.','The teacher was fired for lacerating a student who wrote a poor essay. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(806,0,'adjective','showing sorrow.','Lachrymose and depressed, Alexei Alexandrovich walked two miles home in the rain after learning that his wife was having an affair.','Magoosh\r'),(807,0,'verb','ridicule with satire.','Mark Twain understood that lampooning a bad idea with humor was the most effective criticism.','Magoosh\r'),(808,0,'verb','become feeble.','Stranded in the wilderness for four days, the hiker languished, eating protein bars and nuts.','Magoosh\r'),(809,0,'adjective','lecherous; sexually perverted.','Lolita is a challenging novel for many, not necessarily because of the elevated prose style but because of the depravity of the main character, Humbert Humbert, who, as an old, lascivious man, falls in love with a girl.','Magoosh\r'),(810,0,'adjective','clarity in terms of expression.','Her limpid prose made even the most recondite subjects accessible to all.','Magoosh\r'),(811,0,'noun','any long and tedious account of something.','Mr. Rogers spoke to a Senate committee and did not give a litany of reasons to keep funding the program, but instead, appealed to the basic human decency of all present.','Magoosh\r'),(812,0,'adjective','excessively mournful.','At the funeral, lugubrious songs filled the small church.','Magoosh\r'),(813,0,'adjective','offensively self-assured or given to exercising unwarranted power.','Though she was only a third grade teacher, Ms. Martinet was magisterial in dealing with her class, lording over them like a queen. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(814,0,'noun','the confusion of a word with another word that sounds similar.','Whenever I looked glum, my mother would offer to share \"an amusing antidote\" with me--an endearing malapropism of \"anecdote\" that never failed to cheer me up.','Magoosh\r'),(815,0,'adjective','misconduct or wrongdoing (especially by a public official).','Not even the mayor\'s trademark pearly-toothed grin could save him from charges of malfeasance: while in power, he\'d been running an illegal gambling rink in the room behind his office.','Magoosh\r'),(816,0,'noun','someone shirking their duty by pretending to be sick or incapacitated.','At one time, our country was full of hardworking respectful people, but now it seems that everyone is a malingerer with little inclination to work.','Magoosh\r'),(817,0,'noun','a strict disciplinarian.','The job seemed perfect to Rebecca, until she found out that her boss was a total martinet; after each project the boss would come by to scrutinize--and inevitably criticize--every little detail of the work Rebecca had done.','Magoosh\r'),(818,0,'adjective','overly emotional and sad.','Just as those who were alive during the 70\'s are mortified that they once cavorted about in bellbottoms, many who lived during the 80\'s are now aghast at the maudlin pop songs they used to enjoy--really, just what exactly is a total eclipse of the heart?.','Magoosh\r'),(819,0,'verb','wander aimlessly.','Max liked to maunder down by the seaside and pick up whatever sea shells he would stumble upon.','Magoosh\r'),(819,0,'verb','speak (about unimportant matters) rapidly and incessantly.','After drinking two expressos each, the animated couple would maunder loudly, annoying the other patrons in the coffee shop.','Magoosh\r'),(820,0,'adjective','smooth and sweet-sounding.','Chelsea\'s grandmother thought Franz Schubert\'s music to be the most mellifluous ever written; Chelsea demurred, and to her grandmother\'s chagrin, would blast Rihanna on the home stereo speakers.','Magoosh\r'),(821,0,'noun','a pauper who lives by begging.','Tolstoy was an aristocrat, but he strove to understand the Christianity of the Russian peasants by wandering among them as a mendicant.','Magoosh\r'),(822,0,'adjective','like a meteor in speed or brilliance or transience.','The early spectacular successes propelled the pitcher to meteoric stardom, but a terribly injury tragically cut short his career.','Magoosh\r'),(823,0,'adjective','filled with courage or valor.','For its raid on the Bin Laden\'s compound in Abbottabad, Seal Team Six has become, for many Americans, the embodiment of mettle.','Magoosh\r'),(824,0,'verb','To erroneously attribute; to falsely ascribe; used especially of authorship.','I made a mistake; I misattributed \"Crime and Punishment\" to Leo Tolstoy when it was actually written by Fyodor Dostoyevsky.','Magoosh\r'),(825,0,'noun','a small or moderate or token amount.','If my sister had even a modicum of sense, she wouldn\'t be engaged to that barbarian.','Magoosh\r'),(826,0,'adjective','biting and caustic in thought, manner, or style.','While Phil frequently made mordant remarks about company policy overall, he always was considerably gentler in discussing any person in particular.','Magoosh\r'),(827,0,'verb','to defraud or swindle.','The so-called magical diet cure simply ended up mulcting Maria out of hundreds of dollars, but did nothing for her weight.','Magoosh\r'),(828,0,'noun','the lowest point.','For many pop music fans, the rap and alternative-rock dominated 90s were the nadir of musical expression.','Magoosh\r'),(829,0,'adjective','causing irritation or annoyance.','Maria found her coworkers cell phone nettlesome, because every few minutes it would buzz to life with another text message.','Magoosh\r'),(830,0,'adjective','having an extremely bad smell.','Each August, when the winds moved in a south easterly direction, the garbage dump would spread noisome vapors through the small town.','Magoosh\r'),(831,0,'adjective','coming across as cooly uninterested.','The twenty-somethings at the coffee shop always irked Sheldon, especially the way in which they acted nonchalantly towards everything, not even caring when Sheldon once spilled his mocha on them.','Magoosh\r'),(832,0,'verb','express strong disapproval of.','The manager spent an hour objurgating the employee in the hopes that he would not make these mistakes again.','Magoosh\r'),(833,0,'adjective','not straightforward; indirect.','Herbert never explicitly revealed anything negative about Tom\'s past, but at times he would obliquely suggest that Tom was not as innocent as he seemed. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(834,0,'adjective','noisily and stubbornly defiant; willfully difficult to control.','When the teacher asked the obstreperous student simply to bus his tray, the student threw the entire tray on the floor, shouted an epithet, and walked out.','Magoosh\r'),(835,0,'adjective','be valid, applicable, or true.','The custom of waiting your turn in line does not obtain in some countries, in which many people try to rush to front of the line at the same time. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(836,0,'adjective','slow to learn or understand; lacking intellectual acuity; lacking in insight or discernment.','Jackson was the most obtuse member of the team: the manager\'s subtle ironies were always lost on him.','Magoosh\r'),(837,0,'adjective','intrusive in a meddling or offensive manner.','The professor had trouble concentrating on her new theorem, because her officious secretary would barge in frequently reminding her of some trivial detail involving departmental paperwork.','Magoosh\r'),(838,0,'verb','make rigid and set into a conventional pattern.','Even as a young man, Bob had some bias against poor people, but during his years in social services, his bad opinions ossified into unshiftable views. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(839,0,'adjective','arrogant; presumptuous.','Mark was so convinced of his basketball skills that in his overweening pride he could not fathom that his name was not on the varsity list; he walked up to the basketball coach and told her she had forgotten to add his name.','Magoosh\r'),(840,0,'adjective','acceptable to the taste or mind.','MIkey didn\'t partake much in his friends\' conversations, but found their presence palatable. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(841,0,'verb','speak (about unimportant matters) rapidly and incessantly.','During the rain delay, many who had come to see the game palavered, probably hoping that idle chatter would make the time go by faster. This word has other definitions but this is the most important one for the GRE.','Magoosh\r'),(842,0,'noun','something that has been changed numerous times but on which traces of former iterations can still be seen.','The downtown was a palimpsest of the city\'s checkered past: a new Starbucks had opened up next to an abandoned, shuttered building, and a freshly asphalted road was inches away from a pothole large enough to swallow a small dog.','Magoosh\r'),(843,0,'noun','hypothetical remedy for all ills or diseases; a universal solution.','While the company credit card has made most large purchases easier, it is no panacea: some smaller basic transactions still must be conducted in cash.','Magoosh\r'),(844,0,'noun','a formal expression of praise.','Dave asked Andrew to do just a simple toast, but Andrew launched into a full panegyric, enumerating a complete list of Dave\'s achievements and admirable qualities.','Magoosh\r'),(845,0,'noun','model of excellence or perfection of a kind; one having no equal.','Even with the rise of Kobe Bryant, many still believe that Michael Jordon is the paragon for basketball players.','Magoosh\r'),(845,0,'noun','an ideal instance; a perfect embodiment of a concept.','Some say that Athens was the paragon of democracy, but these people often forget that slaves and women were still not allowed to vote.','Magoosh\r'),(846,0,'noun','an outcast.','The once eminent scientist, upon being found guilty of faking his data, has become a pariah in the research community.','Magoosh\r'),(847,0,'noun','a person who has suddenly become wealthy, but not socially accepted as part of a higher class.','The theater was full of parvenus who each thought that they were surrounded by true aristocrats.','Magoosh\r'),(848,0,'adjective','glaringly obvious.','Since the book had been through no fewer than six proof runs, the staff was shocked to see such a patent spelling mistake remaining, right in the middle of the front cover!.','Magoosh\r'),(849,0,'adjective','relating to or involving money.','The defendent was found guilty and had to serve a period of community service as well as pay pecuniary damages to the client.','Magoosh\r'),(850,0,'adjective','transparently clear; easily understandable.','The professor had a remarkable ability make even the most difficult concepts seem pellucid.','Magoosh\r'),(851,0,'adjective','lacking money; poor.','Truly penurious, Mary had nothing more than a jar full of pennies.','Magoosh\r'),(851,0,'adjective','miserly.','Warren Buffett, famous multi-billionaire, still drives a cheap sedan, not because he is penurious, but because luxury cars are gaudy and impractical.','Magoosh\r'),(852,0,'adjective','highly perceptive.','Even the most percipient editor will make an occasional error when proofreading.','Magoosh\r'),(853,0,'adjective','bossy and domineering.','My sister used to peremptorily tell me to do the dishes, a chore I would either do perfunctorily or avoid doing altogether.','Magoosh\r'),(854,0,'adjective','done routinely and with little interest or care.','The short film examines modern perfunctory cleaning rituals such as washing dishes, doing laundry and tooth-brushing.','Magoosh\r'),(855,0,'adjective','traveling by foot.','Jim always preferred a peripatetic approach to discovering a city: he felt that he could see so many more details while walking.','Magoosh\r'),(856,0,'adjective','acutely insightful and wise